INSERT INTO `casts` (`id`, `name`, `image`, `birthday`, `national`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Helen Mirren', 'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/Helen_Mirren-2208.jpg/250px-Helen_Mirren-2208.jpg', '1945-07-26', 'Anh', 'Dame Helen Lydia Mirren, DBE (sinh ngày 26 tháng 7 năm 1945) là một diễn viên người Anh.\n        Bà đã giành được 1 giải Oscar, 4 giải SAG, 4 giải BAFTA, 3 giải Quả cầu vàng và 4 giải Emmy trong suốt sự nghiệp của mình.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(2, 'Aksel Hennie', 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/Aksel_Hennie.jpg/240px-Aksel_Hennie.jpg', '1975-10-29', 'Anh', 'Hennie was admitted to the Norwegian National Academy of Theatre after applying four times.[2] He graduated in 2001, and has acted both at Teatret Vårt in Molde (2001–2002) and at Oslo Nye Teater (since 2002), where he has been in plays such as Hamlet and Kvinnen Som Gifftet Seg Med en Kalkun (The Woman Who Married a Turkey).[3]\nHennie\'s most notable success has been as a film actor. He made his debut starring in the feature film Jonny Vang in 2003. Although the director, Jens Lien, originally thought Hennie was too young for the role, the actor convinced him he was the right man for the film.[4] That same year, he also acted in the films Buddy and Ulvesommer. The next year, Hennie made his debut as a director and writer with the film, Uno, in which he also acted. For this role, Hennie and his co-star, Nicolai Cleve Broch, undertook six months of hard physical training in order to perform convincingly as bodybuilders.[2]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(3, 'Jorma Tommila', 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Jorma_Tommila_2020_Cropped.jpg/220px-Jorma_Tommila_2020_Cropped.jpg', '1959-01-01', 'Finland', 'Whilst at Helsinki Theatre Academy in 1987, Tommila was one of four founding members of God\'s Theater, a Finnish theater group that made experimental and radical stage art, which included full frontal nudity, setting of fire extinguishers and throwing faeces into the crowd.[4] The four were arrested and fined and given suspended prison sentences and were expelled from the college which caused protest riots from fellow students.[5]\nIn 1997 Tommila won the Jussi Award for Best Actor for his role in the film The Christmas Party, directed by his God Theatre’s fellow founder Jari Halonen.[6]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(4, 'Jack Doolan', 'https://flxt.tmsimg.com/assets/330739_v9_ba.jpg', '1987-07-28', 'Anh', 'Jack Doolan is an English actor. He is best known for portraying Tyler Boyce in the BBC sitcom The Green Green Grass alongside John Challis and Sue Holderness. Doolan has guest starred in other television shows such as Spooks, EastEnders, The Bill and Peep Show and a lead part in Cemetery Junction, a comedy drama film by Ricky Gervais and Stephen Merchant.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(5, 'Bradley Cooper', 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/04/Bradley_Cooper_avp_2014.jpg/200px-Bradley_Cooper_avp_2014.jpg', '1975-01-05', 'M', 'Bradley Charles Cooper (sinh ngày 5/1/1975) là một diễn viên và nhà sản xuất phim người Mỹ. Anh đã được đề cử nhiều giải thưởng danh giá, trong đó có 4 giải Emmy, 2 giải BAFTA và 2 giải Quả Cầu Vàng. Từng là một trong số các diễn viên được trả thù lao cao nhất trong 3 năm liên tiếp, anh từng xuất hiện trong danh sách Forbes Celebrity 100 hai lần, và danh sách 100 người có ảnh hưởng nhất thế giới của tạp chí Times vào năm 2015.\n\nAnh tham gia khóa MFA ở Actors Studio, tại New York vào năm 2000. Sự nghiệp của anh bắt đầu bằng vai diễn phim truyền hình như Sex and the City vào năm 1999, 2 năm sau anh tham gia bộ phim ngắn đầu tiên của mình là Wet Hot American Summer. Tuy nhiên, nhờ vai diễn Will Tippin trong bộ phim trinh thám Alias (2001-2006), anh nhận được nhiều sự chú ý và đạt vài thành công nho nhỏ với vai diễn phụ trong bộ phim hài Wedding Crasher (2005). Vai diễn trong The Hangover năm 2009 là vai diễn đột phá của anh, bộ phim nhận được nhiều đánh giá tích cực và thành công về mặt thương mại, dẫn đến việc có thêm 2 phần được sản xuất vào năm 2011 và năm 2013.\n\nVai diễn nhà văn nghèo khó trong Limitless (2011) và vai diễn cảnh sát mới vào nghề trong bộ phim trinh thám The Place Beyond the Pines (2012) nhận được nhiều lời khen từ giới phê bình. Anh cũng nhận được nhiều thành công với vai diễn trong bộ phim hài tình cảm Silver Linings Playbook (2012), vai phụ trong bộ phim hài trinh thám American Hustle (2013) và tham gia quá trình sản xuất cũng như đóng vai chính trong phim American Sniper (2014). Vì những sự đóng góp này mà anh được đề cử 4 giải Oscar và là diễn viên nam thứ 10 nhận được đề cử giải Oscar trong 3 năm liên tiếp. Năm 2014, anh đóng vai Joseph Merrick trong nhạc kịch The Elephant Man của Broadway, và nhận được đều cử Diễn viên kịch xuất sắc nhất từ giải Tony. Cũng vào năm 2014, anh tham gia lồng tiếng cho nhân vật Rocket Racoon thuộc Vũ trụ điện ảnh Marvel.\n\nCuộc sống riêng tư của anh cũng là đề tài của giới truyền thông. Anh từng kết hôn với Jennifer Espotio từ năm 2006 tới năm 2007, hiện tại anh đang có mối quan hệ với Irina Shayk (cả hai đã có một con gái) từ năm 2015. Anh cũng ủng hộ nhiều tổ chức giúp đỡ mọi người chống lại căn bệnh ung thư.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(6, 'Chris Pratt', 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Chris_Pratt_2018.jpg/220px-Chris_Pratt_2018.jpg', '1979-06-21', 'Mỹ', 'Christopher Michael Pratt (born June 21, 1979)[1] is an American actor. He rose to prominence for playing Andy Dwyer in the NBC sitcom Parks and Recreation (2009–2015). He also appeared in The WB drama series Everwood (2002–2006) and had supporting roles in the films Wanted (2008), Jennifer\'s Body (2009), Moneyball (2011), Zero Dark Thirty (2012), and Her (2013).\n\nPratt has starred as Star-Lord in the Marvel Cinematic Universe, beginning with Guardians of the Galaxy (2014), and as Owen Grady in the Jurassic World trilogy (2015–2022). He has also voiced the main characters in the animated films The Lego Movie (2014), Onward (2020) and The Super Mario Bros. Movie (2023).\n\nPratt\'s other starring roles were in The Magnificent Seven (2016), Passengers (2016), and The Tomorrow War (2021), and the action thriller television series The Terminal List (2022). In 2015, Time magazine named him one of the 100 most influential people in the world.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(7, 'Karen Gillan', 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/07/Stuttgart_-Comic_Con_Germany_2019-_d90_by-RaBoe_116_%28cropped%29.jpg/220px-Stuttgart_-Comic_Con_Germany_2019-_d90_by-RaBoe_116_%28cropped%29.jpg', '1987-11-28', 'Scotland', 'Karen Gillan (sinh ngày 28 tháng 11 năm 1987)[1] là nữ diễn viên, đạo diễn, người mẫu người Scotland.[2][3][4] Gillan đã được công nhận nhờ đóng phim và truyền hình Anh, đặc biệt là khi đóng vai Amy Pond, bạn đồng hành chính của Bác sĩ thứ mười một trong loạt phim khoa học viễn tưởng Doctor Who (2010–2013), cô đã nhận được một số giải thưởng và đề cử. Các vai diễn đầu tiên của cô bao gồm Ally trong bộ phim kinh dị Outcast (2010) và Jane Lockhart trong bộ phim hài lãng mạn Not Another Happy Ending (2013). Cô chuyển sang Hollywood đóng vai chính Kaylie Russell trong bộ phim kinh dị Oculus (2013), thành công thương mại đầu tiên của cô tại Hoa Kỳ, và sau đó cô đóng vai chính trong bộ phim sitcom Selfie (2014).\n\nGillan sau đó đã trở thành ngôi sao quốc tế khi thể hiện Nebula trong các bộ phim siêu anh hùng của Vũ trụ Điện ảnh Marvel Guardians of the Galaxy (2014), Guardians of the Galaxy Vol. 2 (2017), Avengers: Infinity War (2018) và Avengers: Endgame (2019). Cô dự định sẽ đóng lại vai diễn này trong các bộ phim sắp tới Thor: Love and Thunder (2022) và Guardians of the Galaxy Vol. 3 (2023). Gillan đã duy trì sự nổi bật chính với vai diễn Ruby Roundhouse của cô trong các bộ phim hành động Jumanji: Welcome to the Jungle (2017) và Jumanji: The Next Level (2019), cả hai đều đạt được thành công về mặt thương mại. Trên sân khấu, cô xuất hiện trong vở kịch Inadmissible Evidence (2011) của John Osborne và xuất hiện lần đầu trên sân khấu Broadway trong vở kịch Time to Act (2013). Gillan đã nhận được sự hoan nghênh của giới phê bình vì sự tham gia của cô với vai trò biên kịch, đạo diễn và người đóng vai chính trong bộ phim truyền hình The Party\'s Just Beginning (2018).\n\nCác giải thưởng của Gillan bao gồm Giải thưởng Empire, Giải thưởng National Television, Giải Teen Choices và các đề cử cho Giải thưởng BAFTA Scotland và Giải thưởng Sao Thổ. Ngoài diễn xuất, cô còn được chú ý bởi hình ảnh và hoạt động tích cực trước công chúng, đặc biệt là hướng tới việc ngăn chặn tự tử.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(8, 'Zoe Saldana', 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/bc/Zoe_Saldana_%2828584206821%29_%28cropped_2%29.jpg/220px-Zoe_Saldana_%2828584206821%29_%28cropped_2%29.jpg', '1978-06-19', 'Mỹ', 'Zoe Yadira Saldaña Perego[1] (nhũ danh Saldaña Nazario,[2] 19 tháng 6 năm 1978),[3] là một nữ diễn viên người Mỹ. Sau buổi biểu diễn của cô với nhóm kịch Faces, cô đã tham gia hai tập phim năm 1999 của Law & Order. Sự nghiệp điện ảnh của cô bắt đầu một năm sau đó với vai một vũ công ba lê trong phim Center Stage (2000)\n\nSaldaña bắt đầu làm việc trong các bộ phim khoa học viễn tưởng từ năm 2009 với vai diễn đầu tiên trong nhiều lần xuất hiện với vai Nyota Uhura trong loạt phim Star Trek và lần đầu tiên cô xuất hiện với vai Neytiri trong loạt phim Avatar. Cô đóng vai Gamora trong Vũ trụ Điện ảnh Marvel, bắt đầu với Guardians of the Galaxy (2014). Saldaña đã góp mặt trong ba trong số năm phim có doanh thu cao nhất mọi thời đại (Avatar, Avengers: Infinity War và Avengers: Endgame), một thành tích mà bất kỳ diễn viên nào khác cũng không đạt được. Các bộ phim của cô thu về hơn 11 tỷ đô la trên toàn thế giới, và cô là nữ diễn viên điện ảnh có thu nhập cao thứ hai mọi thời đại tính đến năm 2019.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(9, 'Dave Bautista', 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Dave_Bautista_Photo_Op_GalaxyCon_Minneapolis_2019.jpg/250px-Dave_Bautista_Photo_Op_GalaxyCon_Minneapolis_2019.jpg', '1969-01-18', 'Mỹ', 'David Michael Bautista (sinh ngày 18 tháng 1 năm 1969), anh được biết đến với tên võ đài Batista, là một đô vật chuyên nghiệp đã nghỉ hưu, võ sĩ kiêm diễn viên người Mỹ gốc Philippines – Hy Lạp. Với tư cách đô vật chuyên nghiệp, anh từng thi đấu cho World Wrestling Entertainment (WWE) từ năm 2002 đến năm 2010, trong năm 2014 và từ năm 2018 đến 2019. Ngoài đấu vật chuyên nghiệp, anh còn được biết đến với sự nghiệp diễn xuất, đáng chú ý nhất là nhân vật Drax the Destroyer trong Vũ trụ Điện ảnh Marvel.\n\nBautista bắt đầu sự nghiệp đô vật của mình vào năm 1999, và vào năm 2000, anh ký hợp đồng với World Wrestling Federation lúc bấy giờ (WWF, đổi tên thành WWE vào năm 2002). Từ năm 2002 đến 2010, anh nổi tiếng với biệt danh danh Batista và trở thành nhà vô địch thế giới sáu lần khi vô địch hạng nặng thế giới bốn lần và hai lần vô địch WWE. Triều đại đầu tiên của anh với chức vô địch hạng nặng thế giới là triều đại dài nhất cho danh hiệu đó với 282 ngày. Anh ấy cũng đã ba lần tổ chức chức vô địch World Tag Team (hai lần với Ric Flair và một lần với John Cena) và chức vô địch WWE Tag Teammột lần (với Rey Mysterio). Anh là người chiến thắng trong trận đấu Royal Rumble năm 2005 và tiếp tục giành chức vô địch WrestleMania 21, một trong năm sự kiện trả tiền cho mỗi lần xem có doanh thu cao nhất trong lịch sử đấu vật chuyên nghiệp. Sau khi rời WWE vào năm 2010, anh ấy tái ký hợp đồng vào tháng 12 năm 2013, xuất hiện lần đầu tiên vào tháng 1 năm 2014 và giành chiến thắng trong trận đấu Royal Rumble năm đó. Anh ấy đã đặt tiêu đề WrestleMania XXX trước khi một lần nữa khởi hành vào tháng 6 năm đó. Vào tháng 10 năm 2018, Bautista đã trở lại WWE lần thứ hai và đối mặt với Triple H tại WrestleMania 35 vào tháng 4 năm 2019, trước khi từ giã sự nghiệp đấu vật.\n\nBautista bắt đầu diễn xuất vào năm 2006 và đã đóng vai chính trong The Man with the Iron Fists (2012), Riddick (2013), phim James Bond Spectre (2015), Blade Runner 2049 (2017), Army of the Dead và Dune (cùng năm 2021). Trong Vũ trụ Điện ảnh Marvel, anh đã đóng vai Drax the Destroyer trong các phim Guardians of the Galaxy (2014), Guardians of the Galaxy Vol. 2 (2017), Avengers: Infinity War (2018) và Avengers: Endgame (2019). Anh cũng đã xuất hiện trong một số bộ phim direct-to-video kể từ năm 2009.\n\nVào tháng 8 năm 2012, Bautista ký hợp đồng với Classic Entertainment & Sports để chiến đấu trong các môn võ tổng hợp (MMA). Anh ấy đã giành chiến thắng trong cuộc đấu MMA duy nhất của mình vào ngày 6 tháng 10 năm 2012, đánh bại Vince Lucero bằng loại trực tiếp kỹ thuật ở vòng đầu tiên.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(10, 'Scott Eastwood', 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d2/Scott_Eastwood_52nd_Annual_Publicists_Awards_-_Feb_2015_%28cropped%29.jpg/200px-Scott_Eastwood_52nd_Annual_Publicists_Awards_-_Feb_2015_%28cropped%29.jpg', '1986-03-21', 'Mỹ', 'Scott Eastwood (tên khai sinh: Scott Clinton Reeves; sinh ngày 21 tháng 3 năm 1986)[2] là một diễn viên, người mẫu Hoa Kỳ.\n        Anh từng tham gia trong các phim điện ảnh như Flags of Our Fathers (2006), Gran Torino (2008), Invictus (2009), The Forger (2012),\n        Trouble with the Curve (2012), Texas Chainsaw (2013), Fury (2014), The Longest Ride (2015), Mercury Plains (2016), Suicide Squad (2016), Snowden (2016),\n        The Fate of the Furious (2017), Pacific Rim Uprising (2018).\n        Scott cũng làm người mẫu cho nhãn hiệu nước hoa Cool Water của Davidoff. Anh là con út của diễn viên Clint Eastwood.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(11, 'Vin Diesel', 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/71/Vin_Diesel_XXX_Return_of_Xander_Cage_premiere.png/250px-Vin_Diesel_XXX_Return_of_Xander_Cage_premiere.png', '1967-07-18', 'United States', 'Vin Diesel (tên khai sinh là Mark Sinclair[1] hay Mark Vincent;[2] sinh ngày 18 tháng 7 năm 1967) , là một diễn viên và nhà sản xuất người Mỹ. Là một trong những nam diễn viên có doanh thu cao nhất thế giới, anh được biết đến với vai Dominic Toretto trong loạt phim Fast & Furious.\n\nDiesel bắt đầu sự nghiệp của mình vào năm 1990 nhưng chật vật để giành được các vai diễn cho đến khi anh viết kịch bản, đạo diễn, sản xuất và đóng vai chính trong bộ phim ngắn Multi-Facial (1995). Điều này thu hút sự chú ý của Steven Spielberg, người đang phát triển Saving Private Ryan (1998), và viết lại các yếu tố của bộ phim để cho phép Diesel xuất hiện trong một vai phụ. Diesel sau đó đã lồng tiếng cho nhân vật chính trong The Iron Giant (1999) trong khi nổi danh như một ngôi sao hành động sau khi gây ấn tượng với loạt phim Fast & Furious, XXX và The Chronicles of Riddick.\n\nDiesel đóng vai Groot trong các bộ phim siêu anh hùng của Vũ trụ Điện ảnh Marvel, xuất hiện trong Guardians of the Galaxy (2014), Guardians of the Galaxy Vol. 2 (2017), Avengers: Infinity War (2018), Avengers: Endgame (2019) và Thor: Love and Thunder (2022) sắp tới. Anh cũng đóng vai Groot trong bộ phim hoạt hình Ralph Breaks the Internet (2018). Diesel cũng đã giành được thành công về mặt thương mại trong các thể loại khác, chẳng hạn như trong bộ phim hài The Pacifier (2005), trong khi màn trình diễn của anh trong Find Me Guilty (2006) được khen ngợi. Diesel miêu tả Bloodshot chuyển thể từ phim siêu anh hùng vào năm 2020, và dự kiến ​​sẽ xuất hiện trong các phim Avatar sắp tới.\n\nAnh thành lập công ty sản xuất One Race Films, nơi anh cũng là nhà sản xuất hoặc điều hành sản xuất cho những chiếc xe ngôi sao của mình. Diesel cũng thành lập hãng thu âm Racetrack Records và nhà phát triển trò chơi điện tử Tigon Studios, cung cấp khả năng ghi lại chuyển động và giọng nói của anh ấy cho tất cả các bản phát hành của Tigon.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(12, 'Michelle Rodriguez', 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Michelle_Rodriguez_by_Gage_Skidmore_2.jpg/250px-Michelle_Rodriguez_by_Gage_Skidmore_2.jpg', '1978-07-12', 'United Kingdom', 'Mayte Michelle Rodriguez[2] (sinh ngày 12 tháng 7 năm 1978),[3] thường chỉ gọi là Michelle Rodriguez, là một diễn viên, nhà viết kịch bản phim và người chỉnh nhạc.[4] Vai diễn mang tính bước ngoặt trong sự nghiệp của Rodriguez là trong bộ phim độc lập Girlfight (2000). Trong phim, cô đảm nhiệm nhân vật một vận động viên quyền Anh, và phần thể hiện của cô đã nhận được những lời tán dương từ giới phê bình và mang về cho cô một số giải thưởng, trong đó có giải Independent Spirit Award (Giải Tinh thần độc lập)[5] và giải Gotham Award cho Vai diễn khởi đầu xuất sắc nhất.[6] Sau đó, cô lần đầu tiên đến với Hollywood với vai Letty Ortiz trong bom tấn The Fast and the Furious (2001), và tiếp tục đảm nhận vai diễn này trong hai phần tiếp theo là Fast & Furious (2009) và Fast & Furious 6 (2013).\n\nTrong sự nghiệp của mình, cô đã tham gia một số phim hành động khá thành công, với những vai diễn cứng rắn, độc lập như Blue Crush, S.W.A.T., Battle: Los Angeles và bom tấn của đạo diễn James Cameron, Avatar. Cô cũng được biết đến với các vai diễn như Shé trong hai bộ phim hành động hài hước của Robert Rodriguez, Machete và Machete Kills, và vai Rain Ocampo trong loạt phim khoa học viễn tưởng Resident Evil và Resident Evil: Retribution.\n\nRodriguez cũng mở rộng lĩnh vực hoạt động của mình sang truyền hình, với vai diễn Ana Lucia Cortez trong mùa thứ hai của series truyền hình Lost trong vai trò diễn viên chính và sau đó cũng đã xuất hiện vài lần trong vai trò vai diễn khách mời trước khi series này kết thúc. Cô cũng đã tham gia lồng tiếng trong một số trò chơi điện tử như Call of Duty và Halo cũng như lồng tiếng cho phim hoạt hình 3D Turbo và chương trình truyền hình IGPX.[7]\n\nVới tổng doanh thu tất cả các phim cô tham gia là trên 5,2 tỷ USD, Entertainment Weekly cho rằng cô là \"một trong những nữ diễn viên Mỹ Latinh nổi bật nhất Hollywood\".[8]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(13, 'Jason Momoa', 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d6/Jason_Momoa_by_Gage_Skidmore.jpg/200px-Jason_Momoa_by_Gage_Skidmore.jpg', '1979-08-01', 'United States', 'Joseph Jason Namakaeha Momoa (sinh ngày 1 tháng 8 năm 1979) là nam diễn viên, đạo diễn và nhà sản xuất phim người Mỹ.[1]\n\nJason Momoa nổi tiếng với các vai diễn siêu anh hùng trong vũ trụ DC Mở rộng DC Extended Universe, bắt đầu từ năm 2016 với vai thủy thần Aquaman trong Batman v Superman: Dawn of Justice, Justice League và Aquaman.[2][3][4].\n\nTrước đó, Jason Momoa từng vào vai Ronon Dex trong sê-ri phim viễn tưởng Stargate Atlantis (2004–2009), Khal Drogo trong Game of Thrones (2011–2012) hay Declan Harp trong Frontier (2016–nay).\n\nRoad to Paloma là bộ phim đầu tiên mà Jason Momoa làm giám đốc sản xuất kiêm biên kịch, ông cũng tham gia đóng vai chính trong bộ phim này, được phát hành ngày 11 tháng 7 năm 2014.[5]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(14, 'Charlize Theron', 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Charlize-theron-IMG_6045.jpg/220px-Charlize-theron-IMG_6045.jpg', '1975-08-07', 'United States', 'Charlize Theron (phát âm theo tiếng Anh kiểu Mỹ: /ʃɑːrˈliːz ˈθɛrən/; phát âm theo tiếng Afrikaans: [ʃɐrˈlis tron];[1] sinh ngày 7 tháng 8 năm 1975) là một nữ diễn viên kiêm nhà làm phim người Mỹ gốc Nam Phi. Là một trong những nữ diễn viên được trả lương cao nhất thế giới, cô là chủ nhân của nhiều giải thưởng khác nhau, bao gồm giải Oscar, giải SAG và giải Quả cầu vàng. Năm 2016, Time đã vinh danh cô là một trong 100 người có ảnh hưởng nhất trên thế giới.\n\nTheron trở nên nổi tiếng quốc tế vào những năm 1990 khi đóng vai phụ nữ hàng đầu trong các bộ phim Hollywood The Devil\'s Advocate (1997), Mighty Joe Young (1998) và The Cider House Rules (1999). Cô được giới phê bình đánh giá cao nhờ vai diễn kẻ giết người hàng loạt Aileen Wuornos trong Monster (2003), nhờ đó cô đã giành được giải Gấu bạc và Giải Oscar cho nữ diễn viên chính xuất sắc nhất, trở thành người Nam Phi đầu tiên giành giải Oscar ở hạng mục diễn xuất. Cô nhận được một đề cử giải Oscar khác cho vai một phụ nữ bị lạm dụng tình dục đi tìm công lý trong bộ phim truyền hình North Country (2005).\n\nTheron kể từ đó đã đóng vai chính trong một số bộ phim hành động thành công về mặt thương mại, bao gồm The Italian Job (2003), Hancock (2008), Snow White and the Huntsman (2012), Prometheus (2012), Mad Max: Fury Road (2015), The Huntsman: Winter\'s War (2016), The Fate of the Furious (2017), Atomic Blonde (2017), The Old Guard (2020) và F9 (2021). Cô cũng nhận được lời khen ngợi khi đóng vai phụ nữ rắc rối trong các bộ phim truyền hình hài Young Adult (2011) và Tully (2018) của Jason Reitman, và cho vai Megyn Kelly trong bộ phim tiểu sử Bombshell (2019), lần cuối cùng nhận được đề cử Giải Oscar thứ ba.\n\nTừ đầu những năm 2000, Theron đã mạo hiểm sản xuất phim với công ty Denver và Delilah Productions của cô. Cô đã sản xuất nhiều bộ phim, trong đó có nhiều bộ phim mà cô đã đóng vai chính, bao gồm The Burning Plain (2008), Dark Places (2015) và Long Shot (2019). Theron trở thành công dân Mỹ vào năm 2007, trong khi vẫn giữ quốc tịch Nam Phi của mình. Cô đã được vinh danh bằng cách khắc trên ngôi sao trên Đại lộ Danh vọng Hollywood.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(15, 'Brie Larson', 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Captain_Marvel_trailer_at_the_National_Air_and_Space_Museum_4_%28cropped%29.jpg/240px-Captain_Marvel_trailer_at_the_National_Air_and_Space_Museum_4_%28cropped%29.jpg', '1989-10-01', 'United States', 'Brianne Sidonie Desaulniers (sinh ngày 1 tháng 10 năm 1989), được biết đến với nghệ danh Brie Larson (phiên âm tiếng Việt: Bri Lác-xơn[1]), là nữ diễn viên và ca sĩ người Mỹ. Brie Larson được giáo dục tại nhà ở Sacramento, bang California trước khi đi học diễn xuất tại nhà hát American Conservatory Theater.\n\nCô bắt đầu sự nghiệp với tư cách diễn viên nhí trong các chương trình hài kịch trên The Tonight Show with Jay Leno. Cô bắt đầu tham gia các vai phụ trong Sleepover và 13 Going on 30 đều trong năm 2004. Năm 2010, Larson góp mặt trong các bộ phim Greenberg và Scott Pilgrim vs. the World. Trên sóng truyền hình Larson vào vai Kate Gregson trong series hài của Diablo Cody mang tên United States of Tara từ 2009 tới 2011. Cô tiếp tục các vai trò diễn viên phụ trong Rampart (2011), 21 Jump Street (2012), Don Jon (2013) và The Spectacular Now (2013) trước khi đột phá với vai chính trong Short Term 12 (2013).\n\nVào năm 2015, cô là đồng vai chính trong Trainwreck và là nhân vật chính trong Room, bộ phim mang về cho Larson nhiều giải thưởng trong đó có Giải Oscar, Giải BAFTA và Giải Quả cầu vàng.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(16, 'Jason Statham', 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Jason_Statham_2018.jpg/250px-Jason_Statham_2018.jpg', '1967-07-26', 'United Kingdom', 'Jason Statham (sinh ngày 26 tháng 7, năm 1967 tại Shirebrook, Derbyshire, Anh Quốc) là một nam diễn viên điện ảnh và vận động viên nhảy cầu người Anh, được biết đến qua những vai diễn trong những bộ phim tội phạm Lock, Stock and Two Smoking Barrels, Revolver, Snatch,... Statham cũng đóng vai phụ trong vài bộ phim của Mỹ như The Italian Job, cũng như vai chính trong các phim The Transporter, Crank, The Bank Job, War và Death Race.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(17, 'Hoàng Mèo', 'https://35express.org/wp-content/uploads/2022/01/hoang-meo-la-ai-1-35express.jpg', '1982-01-01', 'Viet Nam', 'Hoàng Mèo sinh năm 1982, ghi dấu ấn trong các tác phẩm như Lật mặt: Nhà có khách, Bố già, Chị Mười Ba... Đại Ngọc Trâm xuất thân là diễn viên kịch, sau đó lấn sân phim ảnh. Chị từng đóng các phim như Vợ tui tui sợ, Cặp đôi nội chiến...\n\nHoàng Mèo và Đại Ngọc Trâm gắn bó khi cùng hoạt động ở sân khấu Nụ cười mới. Họ yêu nhau 6 năm trước khi đi đến hôn nhân vào năm 2010. Họ có 2 con chung tên thân mật là Mì Gói và Bún Gạo.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(18, 'Trần Kim Hải', 'https://assets.htv.com.vn/Images/DanQuynh/2023/kkcd/quy2/kimhai.jpg', '1982-01-01', 'Viet Nam', 'Với vẻ ngoài gai góc và đậm chất điện ảnh, Trần Kim Hải là gương mặt mới được đạo diễn Lý Hải tin tưởng giao vai Toàn trong dự án Lật mặt 6 - Tấm vé định mệnh. Với Kim Hải, bộ phim là một bước ngoặt lớn trên hành trình theo đuổi đam mê, mang anh đến gần hơn với công chúng, sau nhiều năm miệt mài làm nghệ thuật. Dự án dài hơi và đầy tâm huyết của một tập thể lớn, đặc biệt dưới thương hiệu đầy uy tín mang tên Lật mặt đã cho anh một cơ hội lớn để thực sự sống với điện ảnh.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(19, 'Thanh Thức', 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/ThanhThuc1984.jpg/200px-ThanhThuc1984.jpg', '1984-04-10', 'Viet Nam', 'Thanh Thức tên đầy đủ là Phạm Thanh Thức, sinh ra tại Trà Vinh, Việt Nam, là một diễn viên, người mẫu nổi tiếng của làng giải trí Việt Nam. Sở hữu gương mặt lạnh, nam tính, lịch lãm, và chiều cao lý tưởng 1m81, Thanh Thức là gương mặt người mẫu xuất hiện trong nhiều sự kiện thời trang lớn nhỏ trong nước. Anh còn được biết đến qua nhiều vai diễn phim truyền hình.[1]\n\nNăm 2006, Thanh Thức giành giải Ba cuộc thi Thời trang Xuân do Nhà văn hóa Thanh Niên tổ chức.[2] Cũng từ đây, anh chính thức bước chân vào sự nghiệp người mẫu chuyên nghiệp. Ngoài ra, anh còn thường xuyên xuất hiện trong chương trình Thời trang và cuộc sống của HTV7, và nhiều chương trình thời trang như: Phong cách đam mê, Duyên dáng Việt Nam, Thời trang và cuộc sống, Hoa hậu Thế giới người Việt...\n\nNăm 2008, Thanh Thức tham gia bộ phim điện ảnh \"Khi yêu đừng quay đầu lại\", là một bộ phim được đánh giá tốt của đạo diễn Võ Nghiêm Minh.[3][4] Sau đó, anh bắt đầu dần dần rời xa sàn catwalk và bước chân vào lĩnh vực điện ảnh, truyền hình qua các phim: Anh chàng đã đi ngược thời gian, Đối mặt, Blog và người đẹp, Siêu mẫu Xì trum... Hiện tại, anh là một người mẫu được nhiều nhãn hàng thời trang cao cấp và nhiều thương hiệu khác mời làm người mẫu quảng cáo.\n\nCũng giống như nhiều diễn viên khác, Thanh Thức cũng găp nhiều khó khăn và áp lực khi mới bước chân vào nghề diễn xuất. Nhưng vì sự ham học hỏi, yêu nghề, nên anh đã nhanh chóng nâng cao khả năng diễn xuất của mình.\n\nLà một người kín tiếng trong chuyện đời tư, vậy nên ít ai biết rằng Thanh Thức đã kết hôn. Nam diễn viên cũng từ chôi chia sẻ về mái ấm của mình vì anh nghĩ rằng chưa đến lúc công bố với khán giả. Anh muốn vợ và con mình có được cuộc sống yên bình, không bị dư luận soi mói.[5][6]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(20, 'Huy Khánh', 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/63/Dien-vien-huy-khanh.jpg/200px-Dien-vien-huy-khanh.jpg', '1981-01-07', 'Viet Nam', 'Anh sinh năm 1981 tại Thành phố Hồ Chí Minh, có cha là người Việt còn mẹ là người Pháp. Anh tốt nghiệp trường Đại học Sân khấu – Điện ảnh Thành phố Hồ Chí Minh.[2] Huy Khánh được khán giả biết đến rộng rãi lần đầu tiên qua bộ phim Dốc tình năm 2004 của đạo diễn Lưu Trọng Ninh qua vai Thái.[2] Năm 2009, anh tham gia phim Chuyện tình xa xứ của đạo diễn Việt kiều Victor Vũ. Năm 2011, anh tiếp tục hợp tác với Victor Vũ khi đóng trong phim Cô dâu đại chiến.\n\nNăm 2012, anh là người dẫn chương trình cho mùa thứ tư của cuộc thi âm nhạc Vietnam Idol.\n\nNăm 2018, Huy Khánh tham gia phim truyền hình Nhà ông Hoàng có ma. Vai diễn Bùi Hoàng trong phim mang về cho anh một giải Ngôi Sao Xanh ở hạng mục Nam diễn viên xuất sắc nhất.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(21, 'Trương Quốc Cường', 'https://images2.thanhnien.vn/thumb_w/640/528068263637045248/2023/3/25/edit-quoc-cuongg-167976189473145731174.png', '1969-09-30', 'Viet Nam', 'Trương Quốc Cường xuất thân trong gia đình có 7 anh chị em, ông đứng thứ 5. Ông tốt nghiệp trường Islamic Kasim Tuet Memorial College. Năm 15 tuổi, ông thi vào Hội thể thao Du Viên, triển khai sự nghiệp đá bóng. Năm 1975, ông làm thành viên đội đại diện bóng đá Hong Kong đến Kuwait tham dự tranh giải U19 của Hiệp hội bóng đá Á Châu. Từ đó, ông được lên đội dự bị tại Du Viên, sau đó lại thăng lên tổ A. Về sau ông từng đá cho đội Đông Phương và Hải Phong, nhưng ít có cơ hội ra sân, trong thời gian đó, ông đã làm quen với Đàm Vịnh Lân và Trần Bách Tường do 2 người thuộc đội dự bị của CLB bóng đá không chuyên. Năm 1976, do TVB tuyển cầu thủ tham gia phim ngắn Vô hoa quả, ông đi thử vai do ham vui, kết quả lại được chọn. Vì cơ duyên đó mà ông đã gia nhập làng giải trí.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(22, 'Trung Dũng', 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/eb/Trung_Dung1973.jpg/200px-Trung_Dung1973.jpg', '1973-01-01', 'Viet Nam', 'Phạm Trung Dũng (sinh năm 1973) nổi tiếng với nghệ danh Trung Dũng, là một nam diễn viên và MC người Việt Nam. Năm 2015, anh đoạt giải thưởng \"Nam diễn viên chính xuất sắc\" tại Lễ trao giải Cánh diều với vai diễn Trung trong Lạc giới.[1]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(23, 'Tiến Luật', 'https://khafa.org.vn/wp-content/uploads/2021/12/202005120252528015-e68fd400-a0c8-4b5b-a065-df5c2657a42b.png', '1982-01-01', 'Viet Nam', 'Diễn viên hài Tiến Luật sinh năm 1982, tính đến nay anh đã 39 tuổi. Tiến Luật hiện nay anh đang sinh sống và làm việc tại TP. Hồ Chí Minh, nước Việt Nam. Tiến Luật chắc hẳn không còn là cái tên xa lạ đối với khán giả qua các bộ phim, cũng như các tiểu phẩm hài. Tiến Luật hiện tại anh đang công tác ở Sân khấu Thế giới trẻ TP HCM. Anh đã được khán giả yêu mến bởi một lối diễn xuất chân thật, và hóm hỉnh. Tiến Luật cũng chính là diễn viên đầy tài năng, đầy nhiệt huyết, và luôn hết lòng đối với sự nghiệp diễn xuất.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(24, 'Thu Trang', 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/1d/THU_TRANG_2020.jpg/250px-THU_TRANG_2020.jpg', '1984-09-23', 'Viet Nam', 'Thu Trang sinh ngày 23 tháng 9 năm 1984 tại Quận 6, Thành phố Hồ Chí Minh trong một gia đình tiểu thương khá giả. Năm 18 tuổi, vừa tốt nghiệp cấp 3, gia đình cô gặp khó khăn về kinh tế.\n\nTừ năm 2002, khi đang học năm nhất trường Cao đẳng Sân khấu – Điện ảnh Thành phố Hồ Chí Minh (nay là trường Đại học Sân khấu – Điện ảnh Thành phố Hồ Chí Minh), Thu Trang đã bắt đầu đi diễn hài cùng các nghệ sĩ đàn anh để kiếm thêm thu nhập hỗ trợ cho gia đình. Sau một thời gian, cô nhận được nhiều lời mời đi đóng phim nên cuộc sống dần ổn định.[3]\n\nThu Trang kết hôn với nam diễn viên Tiến Luật vào năm 2011. Cả hai đã cùng nhau đóng nhiều bộ phim, tham gia nhiều gameshow truyền hình thực tế.[4]\n\nTháng 12 năm 2014, Thu Trang tham dự chương trình hài kịch Ơn giời cậu đây rồi.[5]\n\nNăm 2016, cô cùng chồng là diễn viên Tiến Luật làm giám khảo trong cuộc thi Đấu trường tiếu lâm.[6]\n\nNăm 2020, Thu Trang tham dự bộ phim Tiệc trăng máu và Chị Mười Ba - 3 ngày sinh tử (phần tiếp theo của bộ phim điện ảnh chuyển thể từ phim chiếu mạng trước đó Chị Mười Ba - Phần kết Thập Tam Muội).[7][8][9]\n\nNăm 2021, cô tiếp tục tham gia dự án điện ảnh Chìa khóa trăm tỷ cùng nam diễn viên Kiều Minh Tuấn cùng video âm nhạc 72 phép thần thông của ca sĩ Ngô Kiến Huy', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(25, 'Thái Hòa', 'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c4/THAI_HOA.jpg/250px-THAI_HOA.jpg', '1974-08-10', 'Viet Nam', 'Thái Hòa sinh ngày 10 tháng 8 năm 1974 tại Sài Gòn. Sau này lớn lên, do có lòng đam mê nghệ thuật nên anh quyết định làm diễn viên hài lẫn diễn viên kịch, cách diễn xuất của Thái Hòa khiến không ít khán giả yêu quý. Không những thế, anh còn đảm nhận luôn vai trò biên kịch sân khấu và đạo diễn sân khấu, hai tác phẩm ăn khách nhất của anh là Người vợ ma và Quả tim máu\n\nThái Hòa còn lấn sân sang lĩnh vực điện ảnh, bộ phim đầu tiên anh tham gia là phim Những đứa con thành phố, sau này anh gây nhiều ấn tượng với những bộ phim hài của đạo diễn Việt kiều Charlie Nguyễn như là Để Mai tính, Long Ruồi, Cưới ngay kẻo lỡ, Tèo em và Để Mai tính 2. gần đây nhất là phim \" cây táo nở hoa\".\n\nHiện tại, Thái Hòa đang sống với người vợ mới tên Hồng Thu.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(26, 'Kiều Minh Tuấn', 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/dd/KIEU_MINH_TUAN.jpg/250px-KIEU_MINH_TUAN.jpg', '1988-02-26', 'Viet Nam', 'Kiều Minh Tuấn (sinh ngày 26 tháng 2 năm 1988) là một nam diễn viên người Việt Nam.[1][2] Anh được biết đến và nổi tiếng qua các tác phẩm điện ảnh như: Bụi đời Chợ Lớn (2013), Scandal: Hào quang trở lại (2014), Em chưa 18 (2017), Lật mặt: Ba chàng khuyết (2018), Hạnh phúc của mẹ (2019) Anh Trai Yêu Quái (2019) Nắng 3: Lời hứa của cha (2020), Chị Mười Ba: Ba Ngày Sinh Tử (2020), Tiệc trăng máu (2020), Chìa khóa trăm tỷ (2022).', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(27, 'Trấn Thành', 'https://image-us.24h.com.vn/upload/4-2022/images/2022-12-11/scsacsacsac-1670760945-945-width660height628.jpg', '1987-02-05', 'Viet Nam', 'Trấn Thành sinh ra và lớn lên tại Thành phố Hồ Chí Minh, có cha là người gốc Hoa đến từ Quảng Đông và mẹ là người Tiền Giang. Ngoài tiếng Việt, anh còn có thể nói tiếng Anh, tiếng Quảng Đông và Quan thoại.[1] Trấn Thành từng theo học khoa diễn viên Đại học Sân khấu - Điện ảnh.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(28, 'Yasamin Jasem', 'https://cdns.klimg.com/merdeka.com/i/w/news/2020/10/13/1230867/content_images/670x335/20201013145852-1-yasamin-003-miftahul-arifin.jpg', '2004-02-21', 'Indonesia', 'Updating', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(29, 'Tika Bravani', 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6a/Tika_Bravani_on_Kartini_1.jpg/220px-Tika_Bravani_on_Kartini_1.jpg', '1990-02-17', 'Indonesia', 'Ratu Tika Bravani was born in Denpasar, Bali from Bantenese father named Tubagus Zubir Ramadhan and Minangkabau mother named Kemalia Dewi.[1] The Ratu first name is the Bantenese noble title which is pinned to the female descendants of the first sultan of Banten, Maulana Hasanuddin patrilineally derived from the father who has a first name Tubagus as noble title.[2]\nSince sixteen years old, Bravani had parted ways with her father because her parents divorced and she chose to live with her mother, Kemalia Dewi.[3] On July 30, 2014, Bravani\'s mother died at the fourth day of Eid al-Fitr. Dewi has been sick for a year, and was treated for nine months in hospital for cervical cancer.[4] For Bravani, her mother was a great and tough person, and she never complained even if she had problems.[5] Before she died, Dewi told Bravani to get married soon.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(30, 'Mizuta Wasabi', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSYa06nFydDQ-owVW2eph8oQ66rInym5u--p0YtOhoo&s', '1974-08-04', 'Japan', 'Mizuta Wasabi, sinh 4 tháng 8 năm 1974 tại Aoyama, Mie, là một nữ seiyū. Hiện tại, cô sống ở Iga, Mie và làm việc cho ban quản lý seiyū Ken Production của Utsumi Kenji. Vào tháng 4 năm 2005, cô tham gia lồng tiếng nhân vật Doraemon trong loạt phim hoạt hình dài cùng tên.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(31, 'Megumi Oohara', 'https://resizing.flixster.com/OEIX6AxtTma5vHOS3c8b_X_AjHg=/218x280/v2/https://flxt.tmsimg.com/assets/1091062_v9_aa.jpg', '1975-04-16', 'Japan', 'Ohara Megumi, sinh ngày 16 tháng 4 năm 1975 tại Tokyo, Nhật Bản, là một nữ seiyū. Cô có sở thích là nấu ăn và nghe nhạc. Vào tháng 4 năm 2005, cô tham gia lồng tiếng nhân vật Nobita trong loạt phim hoạt hình dài cùng tên.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(32, 'Sophie Thompson', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSIf9zen6jfc_xKlrgOPfIuDw62NxOB-g-szgbwavhF3JoHMOZr', '1962-01-20', 'United Kingdom', 'Được dịch từ tiếng Anh-Sophie Thompson là một nữ diễn viên người Anh đã từng làm việc trong lĩnh vực điện ảnh, truyền hình và sân khấu. Từng sáu lần được đề cử Giải thưởng Olivier, cô đã giành được Giải thưởng Olivier năm 1999 cho Nữ diễn viên chính xuất sắc nhất trong một vở nhạc kịch cho sự hồi sinh của Into the Woods ở London.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(33, 'Taliyah Blair', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRwvE7QRTkXd45V0GXOLbBcL-IExdQmU6Gbqag4g86m&s', '1962-01-20', 'United Kingdom', 'Taliyah Blair is a British actress, who has become known for her acting in Aladdin (2019), The War of the Worlds (2019), and The Creeping (2021). She began her professional acting career back in 2019. Taliyah also owns a self-titled YouTube channel. Born on , , Taliyah Blair hails from London, United Kingdom. As in 2023, Taliyah Blair\'s age is N/A. Check below for more deets about Taliyah Blair. This page will put a light upon the Taliyah Blair bio, wiki, age, birthday, family details, affairs, controversies, caste, height, weight, rumors, lesser-known facts, and more.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(34, 'Riann Steele', 'https://m.media-amazon.com/images/M/MV5BNDk3MWQ2ODAtYTk3OS00YzgwLWJhMzYtNzZkM2YzYTY2YzBjXkEyXkFqcGdeQXVyMjQwMDg0Ng@@._V1_.jpg', '1987-05-23', 'United Kingdom', 'Riann Steele là một nữ diễn viên người Anh gốc Mỹ. Cô bắt đầu sự nghiệp của mình trong nhà hát. Các bộ phim của cô bao gồm Treacle Jr., Sket và The Creeping. Trên truyền hình, cô đóng vai chính trong bộ phim hài E4 Crazyhead và loạt phim NBC Debris.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(35, 'Jonah Hauer-King', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSyncc1okwDauj-Wguyt34QBv4WqNDkA_GVpQ6TvriW&s', '1995-05-30', 'United Kingdom', 'Jonah Hauer-King (sinh ngày 30 tháng 5 năm 1995) là một nam diễn viên người Anh.[1] Anh đã thủ vai Laurie trong phiên bản 2017 của BBC Little Women,[2][3] và đóng vai Andrius Aras trong phim Ashes in the Snow (2018), Bel Powley, David trong Postcards from London (2018), và Lucas trong phim A Dog\'s Way Home (2019).[4] Ngoài ra, anh còn tham gia diễn xuất trong các phim The Song of Names và Once Upon a Time in Staten Island.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(36, 'Halle Bailey', 'https://media-cdn-v2.laodong.vn/storage/newsportal/2022/9/20/1095362/Halle-Bailey.jpg', '2000-03-27', 'United States', 'Halle Lynn Bailey là một nữ ca sĩ, nhạc sĩ và diễn viên người Mỹ. Cô được biết đến với tư cách là thành viên của bộ đôi Chloe x Halle cùng với chị gái của mình là Chloe Bailey, họ được đề cử cho 5 giải Grammy kể từ năm 2018.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(37, 'Shameik Moore', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQvyMCWiXBhBnqFlVzBAgNfhCFNFGPFHeYuBAxbpe_9LA74E5Cz', '1995-05-04', 'Atlanta, Georgia, Hoa Kỳ', 'Shameik Alti Moore là một nam diễn viên, ca sĩ, vũ công và rapper người Mỹ. Anh được biết đến với vai trò lồng tiếng cho nhân vật Miles Morales / Spider-Man trong phim điện ảnh Người Nhện: Vũ trụ mới cùng các phần tiếp theo của tác phẩm.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(38, 'Phuwin Tangsakyuen', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTGOnZ6CklHnjZWphAGuvpBzW_Ytv481AxfXbOtXYJV&usqp=CAE&s', '2003-07-05', 'Thái Lan', 'Phuwin Tangsakyuen là một diễn viên người Thái Lan. Anh bắt đầu được biết đến qua vai chính Pattawee trong phim Fish Upon the Sky năm 2021, một bộ phim truyền hình được sản xuất bởi GMMTV. Năm 2022 - 2023 anh kết hợp cùng Naravit Lertratkosum cho ra mắt bộ phim Never Let Me Go.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(39, 'Up Poompat Iam-samang', 'https://upload.wikimedia.org/wikipedia/commons/c/c4/Up_Poompat.jpg', '1994-04-12', 'Thái Lan', 'Poompat Iam-samang, còn gọi là Up Poompat, là diễn viên, người mẫu Thái. Anh còn được biết đến với vai Gene itrong Lovely Writer The Series.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(40, 'Nick Kunatip Pinpradab', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR5gEVegHRNhZX3c_GmLnu8Wfevdobui6gWSBcGGn4&usqp=CAE&s', '1994-04-22', 'Thái Lan', NULL, '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(41, 'Rose Byrne', 'cast/qui7olgen3yl5yvorzbw', '1973-07-24', 'Úc', 'Mary Rose Byrne (sinh ngày 24 tháng 7 năm 1979) là nữ diễn viên người Úc. Cô ra mắt lần đầu tiên với một vai nhỏ trong phim Dallas Doll (1994).[1] Năm 2000, cô thủ vai chính trong phim Úc The Goddess of 1967 - bộ phim đã mang về cho cô Giải Nữ diễn viên xuất sắc nhất tại Liên hoan phim Venice.[2] Năm 2011, cô diễn xuất trong nhiều phim thành công về thương mại như Insidious, X-Men: First Class và Bridesmaids.', '2023-07-13 11:02:53', '2023-07-13 11:02:53'),
(42, 'Ty Simpkins', 'cast/zjko9jljp1pj1sn24wsi', '2001-08-06', 'Úc', 'Ty Keegan Simpkins (born August 6, 2001) is an American actor. His notable film credits include Insidious (2011), its sequel Insidious: Chapter 2 (2013), Jurassic World (2015), and Insidious: The Red Door (2023). He is also known for his appearances in the Marvel Cinematic Universe as Harley Keener in Iron Man 3 (2013) and Avengers: Endgame (2019), as well as the independent film The Whale (2022).', '2023-07-13 11:04:57', '2023-07-13 11:04:57'),
(43, 'Patrick Wilson', 'cast/qhiopbflpk3qdczais6d', '1973-07-03', 'Úc', 'Sở hữu chiều cao 1m83 và gương mặt nam tính, Patrick Wilson là gương mặt quen thuộc với các fan dòng phim kinh dị nói chung và fan vũ trụ The Conjuring nói riêng.', '2023-07-13 11:08:01', '2023-07-13 11:08:01'),
(44, 'Tom Cruise', 'cast/ahkccmfimbmcd0npmbbm', '1962-03-07', 'United States', 'Chỉ cao vỏn vẹn 1m7, thế nhưng gương mặt điển trai đã giúp Tom Cruise trở thành hoàng tử thay vì chú lùn màn ảnh. Cuộc đời của nam tài tử là câu chuyện cổ tích có thật, thừa may mắn nhưng cũng không thiếu những nỗ lực của bản thân.', '2023-07-13 11:40:45', '2023-07-13 11:40:45'),
(45, 'Vanessa Kirby', 'cast/yufeizngqfctxenzk8il', '1988-04-18', 'London', 'Vanessa Nuala Kirby (sinh ngày 18 tháng 4 năm 1988)[1] là nữ người mẫu và diễn viên người Anh. Cô từng thủ vai Joanna trong phim điện ảnh hài lãng mạn About Time năm 2013.\r\n\r\nTừ năm 2016 đến 2017, Kirby vào vai Công chúa Margaret trong sê-ri The Crown (đạo diễn Peter Morgan, đài Netflix), vai diễn mang về cho cô giải BAFTA cho Nữ diễn viên phụ xuất sắc nhất trong phim truyền hình.[2] Sau này, Kirby được biết tới rộng rãi hơn qua các vai White Widow trong Mission: Impossible – Fallout (2018) và Hattie Shaw trong Hobbs & Shaw (2019).', '2023-07-13 11:44:44', '2023-07-13 11:44:44'),
(46, 'Rebecca Ferguson', 'cast/tzxg08rxng5bmekljpnn', '1983-10-19', 'Thụy Điển', 'Rebecca Louisa Ferguson Sundström[1] (sinh ngày 19 tháng 10 năm 1983), được biết đến với nghệ danh Rebecca Ferguson, là một nữ diễn viên Thụy Điển.[2] Cô nổi tiếng với vai chính, hoàng hậu Elizabeth Woodville trong The White Queen (2013), đã nhận được đề cử Giải Quả cầu vàng cho Nữ diễn viên chính xuất sắc nhất – Miniseries và phim truyền hình, và vai diễn chính của cô là Ilsa Faust trong Nhiệm vụ bất khả thi: Quốc gia bí ẩn (2015) và vai diễn tiến sĩ Miranda North trong Mầm sống hiểm họa (2017). Ferguson trở lại với vai diễn Ilsa Faust trong Nhiệm vụ bất khả thi: Sụp đổ (2018).', '2023-07-13 11:46:31', '2023-07-13 11:46:31'),
(47, 'Penpak Sirikul', 'cast/sr0mfp5ohrwsxmzbuuwv', '1961-01-31', 'Thailand', 'Born in Chiang Mai,[5] her real name is Wanphen Khuenkaeo. After winning a beauty contest when she was 19, Penpak became a swimsuit model.\r\n\r\nPenpak\'s first film in 1980 was Dok Sanoh Ban Chao (The sanoh flower blooms in the morning), a drama directed by Jazz Siam. That same year she starred opposite Sorapong Chatree in Fai Narok Khum Lokan (Hell fire).[2] She had a son, age 30 in February 2012.[6]', '2023-07-13 11:49:14', '2023-07-13 11:49:14'),
(48, 'Sukollawat Kanarot', 'cast/kltt1lvdx1jtrqwhmacj', '1985-04-18', 'Thailand', 'Sukollawat Kanarot (tiếng Thái: ศุกลวัฒน์ คณารศ, phiên âm: Xu-con-la-vát Kha-na-rốt, sinh ngày 18 tháng 4 năm 1985) còn có biệt danh là Weir (tiếng Thái: เวียร์, phiên âm: Via) là một diễn viên, người mẫu và ca sĩ người Thái Lan. Anh là diễn viên độc quyền của đài Channel 7 (CH7) Thái Lan. Anh được biết đến nhiều nhất qua các bộ phim như Thủ đoạn mưu mô (2012), Âm mưu đen tối (2013), Cạm bẫy hào quang (2014), Theo đuổi tình yêu đến tận cùng thế giới (2014), Bão tố cuộc đời (2016), Cặp đôi cay như ớt (2017), Sự thỏa hiệp của con tim (2018) cùng với phim điện ảnh Malila: The Farewell Flower - một trong những bộ phim được đề cử Giải Oscar 2019.[1][2]', '2023-07-13 11:53:14', '2023-07-13 11:53:14'),
(49, 'Nittha Jirayungyurn', 'cast/wpdp2y5i1lidoufwgzsx', '1990-09-21', 'Thailand', 'Nittha Jirayungyurn (tiếng Thái: นิษฐา จิรยั่งยืน, phiên âm: Nít-tha Chi-ra-dang-dơn, sinh ngày 21 tháng 09 năm 1990) còn có biệt danh là Mew (tiếng Thái: มิว) là một diễn viên người Thái Lan[2], cô hiện là diễn viên độc quyền của đài Channel 3 (CH3). Cô được biết đến qua nhiều vai diễn như Series Quý ông nhà Jutathep (2013), Lửa tình nổi giận (2014), Theo dấu yêu thương (2015), Chuyện tình bậc đế vương (2017), Sức mạnh nguyện ước (2018), bộ phim điện ảnh 24 giờ yêu (2016), bộ phim gây tiếng vang cho Thái Lan và Việt Nam, Yêu thầm anh xã ( 2020 ).', '2023-07-13 11:54:27', '2023-07-13 11:54:27'),
(50, 'Kevin Dorman', 'cast/blqusvsospbqvmwm4g2g', '1970-01-01', 'Mỹ', NULL, '2023-07-13 12:01:42', '2023-07-13 12:01:42'),
(51, 'Erin Cahill', 'cast/sresrlciymi4vjhrsmxs', '1980-01-04', 'Mỹ', 'Erin Jessica Cahill (born January 4, 1980)[1][2] is an American actress. She is best known for her roles as Jen Scotts in Power Rangers Time Force,[3] Ted Mosby\'s sister Heather in How I Met Your Mother, and Kendra Burke in Saving Grace. She had a recurring role as Felicity in the ABC series Red Widow. She is also noted to be the first lead female character for the Call of Duty franchise, as Chloe \'Karma\' Lynch in Call of Duty: Black Ops II and Rebecca Chambers in Resident Evil: Vendetta. Since 2016, Cahill has worked primarily in television movies for Lifetime and Hallmark.', '2023-07-13 12:12:17', '2023-07-13 12:12:17');
