INSERT INTO `directors` (`id`, `name`, `image`, `birthday`, `national`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Louis Leterrier', 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/80/Louis_Leterrier.jpg/250px-Louis_Leterrier.jpg', '1973-06-17', 'Pháp', 'Louis Leterrier (sinh ngày 17 tháng 6 năm 1973) là nam đạo diễn phim người Pháp. Anh từng đạo diễn hai phần phim Transporter đầu tiên,\n    Unleashed (2005), The Incredible Hulk (2008), Clash of the Titans (2010) và Now You See Me (2013).[1][2][3][4]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(2, 'Lý Hải', 'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Ly_hai_1_%28cropped%29.jpg/800px-Ly_hai_1_%28cropped%29.jpg', '1968-09-28', 'Việt Nam', 'Nguyễn Văn Hải (sinh ngày 28 tháng 9 năm 1968), thường được biết đến với nghệ danh Lý Hải, là một nam ca sĩ, diễn viên, đạo diễn,\n        nhà biên kịch kiêm nhà sản xuất điện ảnh người Việt Nam. Bước chân vào lĩnh vực ca hát từ năm 1993, nhưng tên tuổi của anh chỉ thật sự thành danh khi hợp tác với người quản lý Vĩnh Thuyên cho ra đời series album ca nhạc phim Trọn đời bên em vào năm 2001.\n        Với thành công của loạt album này,Lý Hải đã xây dựng thành công thương hiệu cho riêng mình và trở thành một trong những nam ca sĩ ăn khách nhất thời điểm bấy giờ, đặc biệt là đối với khán giả miền Tây Nam Bộ.\n        Với sở trường trình bày những ca khúc thuộc thể loại nhạc trẻ, nhạc Hoa lời Việt với giai điệu và ca từ đơn giản,Lý Hải từng được mệnh danh là \"Ngôi sao ca nhạc bình dân\"', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(3, 'Vũ Ngọc Đãng', 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/V%C5%A8_NG%E1%BB%8CC_%C4%90%C3%83NG.jpg/250px-V%C5%A8_NG%E1%BB%8CC_%C4%90%C3%83NG.jpg', '1974-01-01', 'Việt Nam', 'Vũ Ngọc Đãng (sinh 1974) là nam đạo diễn, nhà biên kịch phim và nhà sản xuất phim người Việt Nam.\n        Anh được biết đến qua vai trò đạo diễn các phim như: Những cô gái chân dài (2004),\n        Bỗng dưng muốn khóc (2008), Đẹp từng centimet (2009) hay Hot boy nổi loạn (2011)', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(4, 'James Gunn', 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/79/James_Gunn_%2828557194032%29_%28cropped%29.jpg/220px-James_Gunn_%2828557194032%29_%28cropped%29.jpg', '1966-08-05', 'Mỹ', 'James Francis Gunn Jr. (sinh ngày 5 tháng 8 năm 1966)[n 1] là một nhà làm phim và diễn viên người Mỹ.\n        Anh ấy bắt đầu sự nghiệp của mình với tư cách là một nhà biên kịch vào giữa những năm 1990, bắt đầu tại Troma Entertainment với Tromeo and Juliet (1997).\n        Sau đó, anh bắt đầu làm đạo diễn, bắt đầu với bộ phim kinh dị - hài Slither (2006), và chuyển sang thể loại siêu anh hùng với Super (2010), Guardians of the Galaxy (2014), Guardians of the Galaxy Vol. 2 (2017), The Suicide Squad (2021), và Guardians of the Galaxy Vol. 3 (2023).\n         In 2022, Warner Bros. Discovery đã thuê Gunn trở thành đồng chủ tịch và đồng giám đốc điều hành của DC Studios.\n        Ông cũng viết kịch bản và đạo diễn phim ngắn The Guardians of the Galaxy Holiday Special (2022) trên Disney+', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(5, 'Jalmari Helander', 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Jalmari_Helander.jpg/220px-Jalmari_Helander.jpg', '1976-07-21', 'Mỹ', 'Jalmari Helander (born 21 July 1976)[1] is a Finnish screenwriter and film director.\n        He is known for the 2010 film Rare Exports: A Christmas Tale (which Cate Blanchett named as one of her favorite movies), the 2014 action-adventure Big Game starring Samuel L. Jackson,\n        and the 2022 WWII action film Sisu.\n        Before turning to feature films, Helander directed several short films and award-winning television commercials.[2]\n        Helander is the brother-in-law of actor Jorma Tommila and the maternal uncle of Jorma\"s son Onni, both of whom have acted in his films.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(6, 'Steven Caple Jr.', 'https://m.media-amazon.com/images/M/MV5BODg3YThjOGMtZTcyYS00NDA4LThhY2EtYzJkYjg2Njg5NmQzXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_.jpg', '1988-02-16', 'Mỹ', 'Steven Caple Jr. (born February 16, 1988) is an American film director, producer, and screenwriter. His credits include The Land (2016), Creed II (2018), A Different Tree, and Prentice-N-Fury\'s Ice Cream Adventure. In 2017, Forbes named Caple Jr. one of the \'30 Under 30\' in Hollywood & Entertainment.\n        He also will direct Transformers: Rise of the Beasts (2023), the seventh live-action Transformers film.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(7, 'Patrick Wilson', 'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c1/Patrick_Wilson_by_Gage_Skidmore.jpg/250px-Patrick_Wilson_by_Gage_Skidmore.jpg', '1973-07-03', 'Virginia,Mỹ,Norfolk', 'Patrick Joseph Wilson (sinh ngày 3 tháng 7 năm 1973) là một diễn viên và ca sĩ người Mỹ. Anh đã dành sự nghiệp đầu tiên của mình với sự tham gia của các vở nhạc kịch Broadway, bắt đầu từ năm 1995. Anh là ứng cử viên giải Tony hai lần cho vai diễn của anh trong Full Monty (2000–2001) và Oklahoma! (2002).\n        Năm 2003, anh xuất hiện trong mini sê ri HBO Angels in America mà anh được đề cử cho Giải Quả cầu vàng và Giải thưởng Emmy Primetime cho diễn viên phụ xuất sắc trong phim truyền hình hoặc phim điện ảnh.[1][2][3]\n        Wilson cũng xuất hiện trong các phim truyện như Phantom of the Opera (2004), Hard Candy (2005), Little Children (2006), Watchmen (2009), Insidious (2010), Quỷ quyệt 2 (2013), và vai nhà thần học Ed Warren trong bộ phim kinh dị siêu nhiên James Wan Ám ảnh kinh hoàng (2013) và The Conjuring 2 (2016), bốn phim sau đã khiến anh nổi danh là một \'scream king\'.\n        Trên truyền hình, anh đóng vai chính trong bộ phim truyền hình CBS A Gifted Man (2011–2012), và Lou Solverson trong mùa thứ hai của FX (kênh truyền hình) Fargo (2015), mà anh đã nhận được đề cử Giải Quả cầu vàng. Anh đã được chọn làm Orm Marius / Ocean Master trong phim phim siêu anh hùng DC Extended Universe tựa Aquaman (2018).', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(8, 'Anggy Umbara', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfiU5ipjTAsk9HR2FhF0OJ8yagCy8xbng_59mfKRBC&usqp=CAE&s', '1980-10-21', 'Indonesia', 'Updating', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(9, 'Douyama Takumi', 'https://cdn-us.anidb.net/images/main/201065.jpg', '1980-10-21', 'Japan', 'Updating', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(10, 'Jamie Hooper', 'https://blazingminds.co.uk/wp-content/uploads/2022/08/WriterDirector_JamieHooper-800x586.jpg', '1980-10-21', 'United States', 'Jamie\'s passion for filmmaking began at an early age, ever since his Dad bought a VHS-C camera and he claimed it as his own. Amazingly he\'s now an award winning filmmaker (who isn\'t?), with films that have screened at festivals around the world, from LSFF to Fantastic Fest. If Jamie isn\'t wielding a camera or slouched behind a computer he can usually be found in a kitchen eating peanut butter on toast.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(11, 'Rob Marshall', 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcRdTWaLJZdipsbn4Y9Y-G78-HrwjSqrvvzEuhW5-0u00YHDKtTo', '1960-10-17', 'United States', 'Robert Doyle Marshall Jr., thường được biết đến với nghệ danh Rob Marshall, là một nam đạo diễn, biên đạo múa kiêm nhà sản xuất điện ảnh người Mỹ.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(12, 'Joaquim Dos Santos', 'https://upload.wikimedia.org/wikipedia/commons/3/3d/Joaquim_Dos_Santos_by_Gage_Skidmore.jpg', '1977-07-22', 'American, Portuguese', 'Joaquim Dos Santos là một họa sĩ kịch bản, đạo diễn, nhà sản xuất, nhà văn và nhà thiết kế người Mỹ gốc Bồ Đào Nha . Anh ấy được biết đến nhiều nhất với công việc đạo diễn trên phim truyền hình Justice League Unlimited , Avatar: The Last Airbender , GI Joe: Resolute , The Legend of Korra và Voltron: Legendary Defender . Anh ấy cũng là đồng đạo diễn của các bộ phim Spider-Man: Across the Spider-Verse (2023) và Spider-Man: Beyond the Spider-Verse (2024).', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(13, 'Justin K. Thompson', 'https://www.imdb.com/name/nm1042511/mediaviewer/rm3815992320/?ref_=nm_ov_ph', NULL, NULL, 'Justin K. Thompson is an illustrator, visual development artist, production designer, and director for animated works. He is one of the three directors of Spider-Man: Across the Spider-Verse.', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(14, 'Kemp Powers', 'https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcS9SQKu7Twrj-8LBLE0QtC5swFHfUZyQF3Zaq1QbhZhWI2Z3ybG', '1973-10-30', 'American', 'Kemp Powers (sinh ngày 30 tháng 10 năm 1973) là một nhà làm phim và nhà viết kịch người Mỹ. Anh ấy được biết đến nhiều nhất với tác phẩm trong vở kịch One Night in Miami , bộ phim chuyển thể cùng tên năm 2020 và Soul . Kịch bản của anh ấy cho One Night in Miami... đã mang về cho anh ấy đề cử Kịch bản chuyển thể hay nhất tại Lễ trao giải Oscar lần thứ 93 vào tháng 4 năm 2021. [1] Tác phẩm của anh ấy về Soul có nghĩa là Powers trở thành người Mỹ gốc Phi đầu tiên đồng đạo diễn một bộ phim hoạt hình của Disney . [2]', '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(15, 'Mike Phontharis Chotkijsadarsopon', 'https://www.nautiljon.com/images/people/01/12/mike_khun_138721.webp', NULL, 'Thái Lan', NULL, '2023-06-29 13:16:17', '2023-06-29 13:16:17'),
(16, 'Christopher McQuarrie', 'director/pzdlgutyjwlmxgurbbsf', '1968-01-01', 'United States', '<p><strong>Christopher McQuarrie</strong> (sinh năm 1968) là nhà biên kịch, đạo diễn và nhà sản xuất người Mỹ. Ông đã nhận được <a href=\"https://vi.wikipedia.org/wiki/Gi%E1%BA%A3i_th%C6%B0%E1%BB%9Fng_%C4%90i%E1%BB%87n_%E1%BA%A3nh_Vi%E1%BB%87n_H%C3%A0n_l%C3%A2m_Anh_Qu%E1%BB%91c\">giải thưởng BAFTA</a>, <a href=\"https://vi.wikipedia.org/wiki/Gi%E1%BA%A3i_th%C6%B0%E1%BB%9Fng_%C4%90i%E1%BB%87n_%E1%BA%A3nh_Vi%E1%BB%87n_H%C3%A0n_l%C3%A2m_Anh_Qu%E1%BB%91c\">Giải thưởng</a> <a href=\"https://vi.wikipedia.org/wiki/Gi%E1%BA%A3i_Tinh_th%E1%BA%A7n_%C4%91%E1%BB%99c_l%E1%BA%ADp\">Tinh thần độc lập</a> và <a href=\"https://vi.wikipedia.org/wiki/Gi%E1%BA%A3i_Oscar_cho_k%E1%BB%8Bch_b%E1%BA%A3n_g%E1%BB%91c_xu%E1%BA%A5t_s%E1%BA%AFc_nh%E1%BA%A5t\">Giải Oscar cho kịch bản gốc xuất sắc nhất</a> cho bộ phim bí ẩn neo-noir <a href=\"https://vi.wikipedia.org/wiki/The_Usual_Suspects\"><i>The Usual Suspects</i></a> (1995).</p><p>McQuarrie ra mắt trong nghề đạo diễn với bộ phim kinh dị tội phạm <a href=\"https://vi.wikipedia.org/w/index.php?title=The_Way_of_the_Gun&amp;action=edit&amp;redlink=1\"><i>The Way of the Gun</i></a> (2000). Ông là cộng tác viên thường xuyên với <a href=\"https://vi.wikipedia.org/wiki/Tom_Cruise\">Tom Cruise</a>, từng viết và đạo diễn các bộ phim hành động <a href=\"https://vi.wikipedia.org/w/index.php?title=Jack_Reacher_(phim)&amp;action=edit&amp;redlink=1\"><i>Jack Reacher</i></a> (2012), <a href=\"https://vi.wikipedia.org/wiki/Nhi%E1%BB%87m_v%E1%BB%A5_b%E1%BA%A5t_kh%E1%BA%A3_thi:_Qu%E1%BB%91c_gia_b%C3%AD_%E1%BA%A9n\"><i>Mission: Impossible - Rogue Nation</i></a> (2015), và <a href=\"https://vi.wikipedia.org/wiki/Nhi%E1%BB%87m_v%E1%BB%A5_b%E1%BA%A5t_kh%E1%BA%A3_thi:_S%E1%BB%A5p_%C4%91%E1%BB%95\"><i>Mission: Impossible - Fallout</i></a> (2018). Ông cũng là thành viên của nhóm viết kịch bản các bộ phim <a href=\"https://vi.wikipedia.org/wiki/%C4%90i%E1%BB%87p_v%E1%BB%A5_Valkyrie\"><i>Valkyrie</i></a> (2008), <a href=\"https://vi.wikipedia.org/wiki/Cu%E1%BB%99c_chi%E1%BA%BFn_lu%C3%A2n_h%E1%BB%93i\"><i>Edge of Tomorrow</i></a> (2014), <a href=\"https://vi.wikipedia.org/wiki/X%C3%A1c_%C6%B0%E1%BB%9Bp_(phim_2017)\"><i>The Mummy</i></a> (2017) và <a href=\"https://vi.wikipedia.org/wiki/Top_Gun:_Maverick\"><i>Top Gun: Maverick</i></a> (2020).</p>', '2023-07-13 11:18:49', '2023-07-13 11:18:49'),
