(19, 'Yuzuru Tachikawa', 'director/yxvigxgxwbo2de3wa9hs', '1981-12-02', 'Japan', '<p><strong>Yuzuru Tachikawa</strong> (立川 譲, <i>Tachikawa Yuzuru</i>, born December 2, 1981) is a Japanese <a href=\"https://en.wikipedia.org/wiki/Anime\">anime</a> director. Starting his career at <a href=\"https://en.wikipedia.org/wiki/Madhouse_(company)\">Madhouse</a>, he is known for directing the anime series <a href=\"https://en.wikipedia.org/wiki/Death_Parade\"><i>Death Parade</i></a>, <a href=\"https://en.wikipedia.org/wiki/Mob_Psycho_100\"><i>Mob Psycho 100</i></a>, and <a href=\"https://en.wikipedia.org/wiki/Deca-Dence\"><i>Deca-Dence</i></a>.</p>', '2023-07-14 16:54:29', '2023-07-14 16:54:29'),
(20, 'Peter Sohn', 'director/advjgzeymoobypqgailq', '1977-10-18', 'United States', '<p><strong>Peter Sohn</strong> (born October 18, 1977) is an American animator, voice actor, storyboard artist, and film director, best known for his work at <a href=\"https://en.wikipedia.org/wiki/Pixar_Animation_Studios\">Pixar Animation Studios</a>. He directed the short film <a href=\"https://en.wikipedia.org/wiki/Partly_Cloudy\"><i>Partly Cloudy</i></a> (2009) and the feature films <a href=\"https://en.wikipedia.org/wiki/The_Good_Dinosaur\"><i>The Good Dinosaur</i></a> (2015) and <a href=\"https://en.wikipedia.org/wiki/Elemental_(2023_film)\"><i>Elemental</i></a> (2023). He has also been the voice of Emile in <a href=\"https://en.wikipedia.org/wiki/Ratatouille_(film)\"><i>Ratatouille</i></a> (2007), Squishy in <a href=\"https://en.wikipedia.org/wiki/Monsters_University\"><i>Monsters University</i></a> (2013), and Sox in <a href=\"https://en.wikipedia.org/wiki/Lightyear_(film)\"><i>Lightyear</i></a> (2022).</p><p>After graduating from school, he worked at <a href=\"https://en.wikipedia.org/wiki/The_Walt_Disney_Company\">The Walt Disney Company</a> and <a href=\"https://en.wikipedia.org/wiki/Warner_Bros.\">Warner Bros.</a> before coming to Pixar in the art and story departments for <a href=\"https://en.wikipedia.org/wiki/Finding_Nemo\"><i>Finding Nemo</i></a>.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-2\">[2]</a> He also worked on <a href=\"https://en.wikipedia.org/wiki/The_Incredibles\"><i>The Incredibles</i></a>, <a href=\"https://en.wikipedia.org/wiki/Ratatouille_(film)\"><i>Ratatouille</i></a> and <a href=\"https://en.wikipedia.org/wiki/WALL-E\"><i>WALL-E</i></a>. Sohn performed the voice of Remy\'s brother, Emile in <i>Ratatouille</i>. He made his directorial debut with the short film <a href=\"https://en.wikipedia.org/wiki/Partly_Cloudy\"><i>Partly Cloudy</i></a> in 2009 which he also wrote. <i>Partly Cloudy</i> was included in the <a href=\"https://en.wikipedia.org/wiki/Animation_show_of_shows\">Animation Show of Shows</a> in 2009. Sohn co-directed the English-language version of <a href=\"https://en.wikipedia.org/wiki/Ponyo\"><i>Ponyo</i></a> in 2009 with <a href=\"https://en.wikipedia.org/wiki/John_Lasseter\">John Lasseter</a> and <a href=\"https://en.wikipedia.org/wiki/Brad_Lewis\">Brad Lewis</a> (fellow Pixar workers).<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-3\">[3]</a> Russell, the boy in <a href=\"https://en.wikipedia.org/wiki/Up_(2009_film)\"><i>Up</i></a>, was based on Sohn\'s appearance.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-4\">[4]</a> He voiced Russell in the corresponding short, <a href=\"https://en.wikipedia.org/wiki/George_%26_A.J.\"><i>George &amp; A.J.</i></a>, and Squishy in the feature <a href=\"https://en.wikipedia.org/wiki/Monsters_University\"><i>Monsters University</i></a>.</p><p>Sohn directed <a href=\"https://en.wikipedia.org/wiki/The_Good_Dinosaur\"><i>The Good Dinosaur</i></a>, which was released in November 2015. He voiced its <a href=\"https://en.wikipedia.org/wiki/Styracosaurus\"><i>Styracosaurus</i></a> character Forrest Woodbush.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-newdate-5\">[5]</a> The film is notable for being <a href=\"https://en.wikipedia.org/wiki/Pixar\">Pixar</a>\'s first film to be a <a href=\"https://en.wikipedia.org/wiki/Box_office_bomb\">box office flop</a>.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-6\">[6]</a> Emily St. James at <a href=\"https://en.wikipedia.org/wiki/Vox_(website)\"><i>Vox</i></a> praised the films for its \"gorgeous visuals\" but criticized its story writing, \"The film\'s story isn\'t just derivative — it actively rips off other, better movies.\"<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-7\">[7]</a> <a href=\"https://en.wikipedia.org/wiki/Peter_Bradshaw\">Peter Bradshaw</a> of <a href=\"https://en.wikipedia.org/wiki/The_Guardian\"><i>The Guardian</i></a> agreed writing, \"It may be visually impressive, but this Jurassic outing lacks the passion and sophistication that we’ve come to expect from Pixar\".<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-8\">[8]</a></p><p>Sohn was set to voice the <a href=\"https://en.wikipedia.org/wiki/Marvel_Comics\">Marvel Comics</a> character <a href=\"https://en.wikipedia.org/wiki/Ganke_Lee\">Ganke Lee</a> in the <a href=\"https://en.wikipedia.org/wiki/Sony_Pictures_Animation\">Sony Pictures Animation</a> feature film <a href=\"https://en.wikipedia.org/wiki/Spider-Man:_Into_the_Spider-Verse\"><i>Spider-Man: Into the Spider-Verse</i></a>, but his lines were ultimately deleted from the final film.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-slashfilm-9\">[9]</a> However, he eventually voiced Ganke in the sequel, <a href=\"https://en.wikipedia.org/wiki/Spider-Man:_Across_the_Spider-Verse\"><i>Spider-Man: Across the Spider-Verse</i></a>. Sohn provided the voice of Sox, a robotic kitten, in the Pixar film <a href=\"https://en.wikipedia.org/wiki/Lightyear_(film)\"><i>Lightyear</i></a> (2022).<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-10\">[10]</a></p><p>Sohn\'s sophomore effort as a director at Pixar, <a href=\"https://en.wikipedia.org/wiki/Elemental_(2023_film)\"><i>Elemental</i></a>, is based on his experience growing up in New York. The film incorporates the <a href=\"https://en.wikipedia.org/wiki/Classical_element\">classical elements</a> of fire, water, air, and earth as the sentient residents of a city. The film debuted out of competition to initially negative reviews at the <a href=\"https://en.wikipedia.org/wiki/2023_Cannes_Film_Festival\">76th Cannes Film Festival</a>.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-11\">[11]</a><a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-12\">[12]</a> It was released June 16, 2023 to positive reviews. The film is the 27th feature film made by Pixar.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-Variety-13\">[13]</a><a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-14\">[14]</a> The film is Sohn\'s second film to fail commercially, making history as Pixar\'s worst performing film at the box office.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-15\">[15]</a><a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-16\">[16]</a> The commercial failure of <i>Elemental</i> has led to discussion of the potential impact on Pixar\'s viability.<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-17\">[17]</a> Reviews for the film have been mixed with Allison Willmore of <a href=\"https://en.wikipedia.org/wiki/Vulture_(magazine)\"><i>Vulture</i></a> writing, \"<i>Elemental</i> is the second feature from Peter Sohn, a Pixar stalwart who has been with the company since 2000 but as a director is now 0 for 2...the visuals are there but the storytelling lately falls flat\".<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-18\">[18]</a> David Fear of <a href=\"https://en.wikipedia.org/wiki/Rolling_Stone_(magazine)\"><i>Rolling Stone</i></a> wrote \"It’s so busy trying to pen an op-ed that it forgets to give it a narrative structure and make it emotionally resonate. That’s just elementary.\"<a href=\"https://en.wikipedia.org/wiki/Peter_Sohn#cite_note-19\">[19]</a></p>', '2023-07-14 17:12:10', '2023-07-14 17:12:10'),
(21, 'Park Hoon-jung', 'director/huvlnrwkmkojulpgnnjo', '1975-01-14', 'Hàn Quốc', NULL, '2023-07-14 21:02:33', '2023-07-14 21:02:33'),
(22, 'Sophon Sakdaphisit', 'director/cvjscalvzfb1b1aqv0xl', '1982-03-22', 'Thái Lan', NULL, '2023-07-17 20:12:01', '2023-07-17 20:12:01'),
(23, 'Kirk DeMicco', 'director/hlwbdjmpdpaoxdztzuly', '1969-05-15', 'Hoa Kỳ', '<p>Kirk DeMicco (born May 15, 1969) is an <strong>American filmmaker</strong>. He is best known for writing and directing Space Chimps (2008), The Croods (2013), Vivo (2021), and Ruby Gillman, Teenage Kraken (2023).</p>', '2023-07-17 20:22:25', '2023-07-17 20:22:25'),
(24, 'Faryn Pearl', 'director/jooxtelkogq6zuxk3yjf', NULL, 'Hoa Kỳ', NULL, '2023-07-17 20:26:57', '2023-07-17 20:26:57');
