INSERT INTO `movies` (`id`, `name`, `image`, `showTime`, `releaseDate`, `endDate`, `national`, `description`, `trailer`, `rating_id`, `status`, `created_at`, `updated_at`) VALUES
(1, 'FAST & FURIOUS 10', 'https://upload.wikimedia.org/wikipedia/vi/2/22/Fast_X_VN_poster.jpg', 141, '2023-05-19', '2023-06-19', 'United States', 'Trong Fast Five (2011), Dom và nhóm của anh đã tiêu diệt trùm ma túy người Brazil Hernan Reyes ở Rio De Janeiro. Điều họ không biết là con trai của Reyes, Dante đã chứng kiến tất cả và dành 12 năm qua để lên một kế hoạch “hoàn hảo” sẽ khiến gia đình Dom phải trả giá đắt. Trải qua nhiều nhiệm vụ khó khăn tưởng chừng như bất khả thi nhưng Dom Toretto và gia đình của anh ấy đều đã vượt qua. Họ đánh bại mọi kẻ thù trên hành trình hơn 20 năm qua. Nhưng giờ đây, Dante được đánh giá là kẻ nguy hiểm nhất mà họ sẽ đối mặt: một mối đe dọa đáng sợ xuất hiện từ bóng tối của quá khứ, một kẻ thù đẫm máu, với quyết tâm phá tan gia đình và phá hủy mọi thứ mà Dom yêu thương mãi mãi. Phim mới Fast & Furious 10 ra mắt tại các rạp chiếu phim từ 19.05.2023.', 'eoOaKN4qCKw', 3, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(2, 'LẬT MẶT 6: TẤM VÉ ĐỊNH MỆNH', 'https://www.cgv.vn/media/catalog/product/cache/1/thumbnail/190x260/2e2b8cd282892c71872b9e67d2cb5039/l/m/lm6_2x3_layout.jpg', 132, '2023-04-26', '2023-07-16', 'Viet Nam', '<p>Tấm vé có mệnh giá 10.000 đồng và sở hữu những con số \"định mệnh\": 10, 16, 18, 20, 27, 28 - ngày sinh của hội bạn thân sáu người do Trung Dũng, Quốc Cường, Thanh Thức, Huy Khánh, Hoàng Mèo, Trần Kim Hải đảm nhận. Tuy nhiên, nhân vật do Thanh Thức thủ vai, cũng là người giữ tấm vé trúng giải độc đắc lại không may bị tai nạn và qua đời, từ đây, những người còn lại phải dùng đủ mọi cách để tìm lại tấm vé “đổi đời”. Liệu nhóm bạn có thành công và giải mã được cái chết bị ẩn người người bạn thân? Cùng chờ đón đến 28.04 để biết được câu trả lời nha!</p>', '2EnP2tVC00Q', 2, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(3, 'CON NHÓT MÓT CHỒNG', 'https://www.cgv.vn/media/catalog/product/cache/1/thumbnail/190x260/2e2b8cd282892c71872b9e67d2cb5039/7/0/700x1000_2_.jpg', 112, '2023-04-21', '2023-06-21', 'Viet Nam', 'Lấy cảm hứng từ web drama Chuyện Xóm Tui, phiên bản điện ảnh sẽ mang một màu sắc hoàn toàn khác: hài hước hơn, gần gũi và nhiều cảm xúc hơn. Bộ phim là câu chuyện của Nhót - người phụ nữ “chưa kịp già” đã sắp bị mãn kinh, vội vàng đi tìm chồng. Nhưng sâu thẳm trong cô là khao khát muốn có một đứa con, và luôn muốn hàn gắn với người cha suốt ngày say xỉn của mình.', 'e7KHOQ-alqY', 2, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(4, 'GUARDIANS OF THE GALAXY VOL.3 VỆ BINH DẢI NGÂN HÀ 3', 'https://www.cgv.vn/media/catalog/product/cache/1/thumbnail/190x260/2e2b8cd282892c71872b9e67d2cb5039/3/5/350x495_1.png', 149, '2023-05-03', '2023-07-03', 'United States', 'Vệ binh dải Ngân Hà 3 là một bộ phim điện ảnh siêu anh hùng Mỹ công chiếu vào năm 2023 dựa trên nhóm siêu anh hùng Vệ binh dải Ngân Hà của Marvel Comics, do Marvel Studios sản xuất và Walt Disney Studios Motion Pictures phát hành', 'cfbKqpbdrYg', 1, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(5, 'KHANZAB TIẾNG GỌI ÂM BINH', 'https://www.cgv.vn/media/catalog/product/cache/1/thumbnail/240x388/c88460ec71d04fa96e628a21494d2fd3/k/z/kz_main-poster_fb.jpg', 88, '2023-05-26', '2023-07-26', 'Indonesia', 'Chuyện phim theo chân Rahayu - cô gái từng chứng kiến cha mình bị giết hại trong vụ thảm sát Banyuwangi năm 1998. Tại đây, những thầy cúng bị nghi ngờ thực hành ma thuật đen sẽ bị người dân giả dạng ninja để sát hại. Sau sự cố này, Rahayu cùng gia đình quyết định rời khỏi Banyuwangi để chuyển đến quê hương của họ ở Jetis, Yogyakarta.', 'RSADESwWRyw', 3, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(6, 'Doraemon: Nobita và vùng đất lý tưởng trên bầu trời', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/m/a/main_poster_-_dmmovie2023.jpg', 108, '2023-05-26', '2023-07-26', 'Japan', 'Doraemon: Nobita’s Sky Utopia 2023 kể về chuyến phiêu lưu của Doraemon, Nobita và những người bạn thân tới Paradapia - một hòn đảo hình trăng lưỡi liềm lơ lửng trên bầu trời. Ở nơi đó, tất cả đều hoàn hảo… đến mức cậu nhóc Nobita mê ngủ ngày cũng có thể trở thành một thần đồng toán học, một siêu sao thể thao. Cả hội Doraemon cùng sử dụng một món bảo bối độc đáo chưa từng xuất hiện trước đây để đến với vương quốc tuyệt vời này. Cùng với những người bạn ở đây, đặc biệt là chàng robot mèo Sonya, nhóm Doraemon đã có chuyến hành trình tới vương quốc trên mây tuyệt vời… cho đến khi những bí mật đằng sau vùng đất lý tưởng này được hé lộ.', 'bUTfUVLP_Zk', 1, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(7, 'THE CREEPING OÁN HỒN', 'https://cdn.galaxycine.vn/media/2023/4/13/oan-hon-du-kien-khoi-chieu-26-05-2023_1681379006801.jpg', 94, '2023-05-26', '2023-07-26', 'United States', 'Trải nghiệm thời thơ ấu đau thương, Anna trở về căn nhà xưa để chăm sóc người bà ốm yếu. Từ đó, những điều kỳ lạ bắt đầu xảy ra và các sự kiện kỳ quái dần xuất hiện cho đến khi Anna phát hiện ra mọi việc có liên quan đến một quá khứ bi thảm đã ám lên các thành viên trong gia đình. Điều gì sẽ xảy ra với Anna khi mọi oán niệm được ẩn giấu phía sau ngôi nhà và người bà kỳ lạ? ', 'ju2evnXK3PQ', 3, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(8, 'THE LITTLE MERMAID NÀNG TIÊN CÁ', 'https://cdn.galaxycine.vn/media/2023/5/26/300x450-tien-ca_1685071821037.jpg', 135, '2023-07-06', '2023-09-26', 'United States', '“Nàng Tiên Cá” là câu chuyện được yêu thích về Ariel - một nàng tiên cá trẻ xinh đẹp và mạnh mẽ với khát khao phiêu lưu. Ariel là con gái út của Vua Triton và cũng là người ngang ngạnh nhất, nàng khao khát khám phá về thế giới bên kia đại dương. Trong một lần ghé thăm đất liền, nàng đã phải lòng Hoàng tử Eric bảnh bao. Trong khi tiên cá bị cấm tiếp xúc với con người, Ariel đã làm theo trái tim mình. Nàng đã thỏa thuận với phù thủy biển Ursula hung ác để cơ hội sống cuộc sống trên đất liền. Nhưng cuối cùng việc này lại đe dọa tới mạng sống của Ariel và vương miện của cha nàng', 'RxXHUnAi45E', 2, 1, '2023-06-29 20:16:17', '2023-06-29 20:16:17'),
(9, 'NGƯỜI NHỆN: DU HÀNH VŨ TRỤ NHỆN', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/r/s/rsz_nguoi-nhen-2023.jpg', 140, '2023-06-01', '2023-06-30', 'United States', 'Vô số Spider-Man từ khắp các vũ trụ đang đối đầu nhau?!', 'SUz8Aw28vrc', 5, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(10, 'HOON PAYON: BÙA HÌNH NHÂN', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/p/o/poster_bhn_7-_kc_02.06.2023_1_.jpg', 101, '2023-06-02', '2023-06-30', 'Thailand', '<p>Được lấy cảm hứng từ loại bùa hình nhân hộ mệnh nổi tiếng ở Thái Lan, phim theo chân Tham trong hành trình đến một hòn đảo hẻo lánh để tìm người anh trai của mình đang tu hành ở đó. Tham phát hiện ra anh trai đã bị sát hại sau khi bị buộc tội giết người và trộm cắp. Quyết tâm ở lại hòn đảo để điều tra cũng như minh oan cho anh trai nhưng Tham lại vô tình khám phá ra nhiều cái chết bí ẩn khác tại ngôi làng bên cạnh.</p>', 'PcCAFRdiPe4', 2, 0, '2023-06-29 13:16:17', '2023-08-16 03:22:56'),
(11, 'INSIDIOUS 5: THE RED DOOR', 'movies/ryiiwsijft1qpkzeblhf', 107, '2023-07-12', '2023-09-12', 'United States', '<p>Quỷ Quyệt 5: Cửa Đỏ Vô Định – Insidious 5: The Red Door&nbsp;lấy bối cảnh sau mười năm kể từ hai phần phim đầu tiên, Josh Lambert (Patrick Wilson) đang chuyển đến sinh sống tại phía Đông để đưa cậu con trai Dalton (Ty Simpkins) đến học tại một trường đại học bình dị, phủ đầy cây thường xuân. Tuy nhiên, giấc mơ đại học của Dalton lại trở lại một ác mộng khi những con quỷ bị kìm hãm trong quá khứ bằng một cách nào đó đã quay trở lại và tiếp tục ám hai cha con. Phim mới Quỷ Quyệt: Cửa Đỏ Vô Định khởi chiếu 14.07.2023 tại rạp chiếu phim toàn quốc. Xem thêm tại: https://www.galaxycine.vn/dat-ve/insidious-the-red-door<br><br>&nbsp;</p>', 'VJyx2KZ-ILc', 2, 1, '2023-07-13 11:12:28', '2023-07-13 12:44:37'),
(12, 'MISSION: IMPOSSIBLE DEAD RECKONING PART ONE', 'movies/qboncrwj9zihcjxu3h7x', 164, '2023-07-08', '2023-09-08', 'United States', '<p>Câu chuyện lần này diễn ra khi Ethan Hunt và đội IMF của anh ta bắt đầu nhiệm vụ nguy hiểm nhất của họ: Theo dõi một vũ khí mới đáng sợ đe dọa toàn nhân loại trước khi nó rơi vào tay kẻ xấu. Với quyền kiểm soát tương lai và số phận thế giới đang bị đặt cược, và những thế lực đen tối từ quá khứ của Ethan tiến gần, một cuộc đua chết người xung quanh thế giới bắt đầu. Đối mặt với một kẻ thù bí ẩn, toàn năng, Ethan buộc phải xem xét rằng không có gì có thể quan trọng hơn nhiệm vụ của anh ta - ngay cả những người anh ta quan tâm nhất. Phim mới Nhiệm Vụ: Bất Khả Thi Nghiệp Báo Phần Một khởi chiếu 14.07.2023 tại rạp chiếu phim toàn quốc. Xem thêm tại: https://www.galaxycine.vn/dat-ve/mission-impossible-dead-reckoning-part-one<br>&nbsp;</p>', 'TVEIIUXUC6E', 2, 1, '2023-07-13 12:18:23', '2023-07-13 12:45:06'),
(13, 'HOME FOR RENT', 'movies/kv2kqampsim7vfbj3qem', 122, '2023-06-21', '2023-09-21', 'Thailand', '<p>Phim kể về cặp vợ chồng Ning, Kwin và cô con gái 7 tuổi với tên gọi Ing. Vì khó khăn về tài chính, hai vợ chồng quyết định cho thuê ngôi nhà đang ở và chuyển đến một căn hộ chung cư giá rẻ để sinh sống.&nbsp; Sau khi những người thuê nhà chuyển đến, Ning nhận thấy chồng bắt đầu có những hành vi bất thường. Anh ta trở nên bí mật và thường biến mất khỏi căn hộ và lúc 4 giờ sáng. Kwin thậm chí còn có một hình xăm kỳ lạ ở ngực tựa như ký hiệu đặc biệt của một hội tà giáo bí ẩn. Khi hành vi của chồng ngày càng trở nên đáng lo ngại, cũng là lúc Ning nhận ra cô con gái của mình đang gặp hiểm nguy. Bí mật nào đang được che giấu trong ngôi nhà cho thuê của họ?&nbsp; Phim mới Tà Chú Cấm khởi chiếu 09.06.2023 tại rạp chiếu phim toàn quốc.</p>', 'x7P9GdWiHo8', 3, 1, '2023-07-13 12:20:23', '2023-07-13 12:45:45'),
(14, 'RESIDENT EVIL: DEATH ISLAND', 'movies/vq65y8nrklkjfb9nl1oc', 91, '2023-07-07', '2023-09-07', 'Japan', '<p>Đặc vụ D.S.O. Leon S. Kennedy đang thực hiện nhiệm vụ giải cứu Tiến sĩ Antonio Taylor khỏi những kẻ bắt cóc, thì bất ngờ bị một phụ nữ bí ẩn ngăn cản. Trong lúc đó, đặc vụ B.S.A.A. Chris Redfield đang điều tra một đại dịch xác sống ở San Francisco mà chưa xác định được nguyên nhân lây nhiễm. Điểm chung duy nhất của các nạn nhân là tất cả đều ghé thăm đảo Alcatraz không lâu trước đó. Lần theo manh mối này, Chris và đồng đội tìm đến hòn đảo, nơi một cơn kinh hoàng khác đang chờ đón họ. Phim mới&nbsp;Resident Evil: Đảo Tử Thần ra mắt tại các rạp chiếu phim từ 07.07.2023&nbsp;</p>', 'TE2LSlXgX3A', 3, 1, '2023-07-13 12:31:41', '2023-07-13 12:46:25'),
(15, 'DETECTIVE CONAN: BLACK IRON SUBMARINE', 'movies/lar4ykgji5em7qloyn4n', 110, '2023-07-21', '2023-11-20', 'Japan', '<p>Thám Tử Lừng Danh Conan: Tàu Ngầm Sắt Màu Đen&nbsp;là phần phim đang đạt doanh thu ấn tượng của loạt phim về cậu bé thám tử. Lấy bối cảnh tại Pacific Buoy - một trụ sở hàng hải của Interpol có nhiệm vụ kết nối các camera an ninh trên toàn thế giới. Theo lời mời của Sonoko, nhóm Conan&nbsp;đến Hachijojima để xem cá voi. Tại đây, Conan nhận được thông tin về một nhân viên Europol bị ám sát. Cùng với đó, tính mạng Haibara bị đe dọa, phải chăng thân phận của cô đã bị bại lộ trước Gin - nhân vật nguy hiểm hàng đầu của tổ chức áo đen…&nbsp; Tàu Ngầm Sắt Màu Đen đang đứng đầu doanh thu phòng vé tại Nhật Bản, phá vỡ hàng loạt kỉ lục của những người anh em trước. Phim đạt doanh thu hơn 3 tỷ yên chỉ trong cuối tuần mở màn đầu tiên.&nbsp;&nbsp;</p><p>Phim mới&nbsp;Thám Tử Lừng Danh Conan: Tàu Ngầm Sắt Màu Đen ra mắt tại các rạp chiếu phim từ 21.07.2023&nbsp;&nbsp;</p>', 'e-ta72_8Brw', 5, 1, '2023-07-14 16:57:04', '2023-07-14 20:20:23'),
(16, 'XỨ SỞ CÁC NGUYÊN TỐ', 'movies/j3kbzxyw23xy4ym6aejz', 109, '2023-06-23', '2023-09-27', 'United States', '<p>Bộ phim sẽ là hành trình xoay quanh mối quan hệ giữa cô nàng guyên tố lửa, Ember (do Lewis lồng tiếng) và chàng trai nguyên tố nước, Wade (do Athie lồng tiếng), những cá thể không thể chạm được đến nhau; nhưng cùng nhau khám phá xem họ có bao nhiêu điểm chung giống nhau.&nbsp;</p><p>Phim mới&nbsp;Xứ Sở Các Nguyên Tố&nbsp;dự kiến&nbsp;khởi chiếu 16.06.2023 tại các rạp chiếu phim toàn quốc.&nbsp;&nbsp;</p>', 'j2DD_MlAnoA', 5, 1, '2023-07-14 17:23:30', '2023-07-14 20:20:02'),
(17, 'THANH TRA SÁT NHÂN', 'movies/fbgfnm6vngqxthh5dvmp', 180, '2023-07-28', '2023-10-15', 'Korea, Republic of', NULL, 'Co26KuJ1f8E', 2, 1, '2023-07-14 20:15:59', '2023-07-27 18:26:56'),
(18, 'TRĂM NĂM HẠNH PHÚC!', 'movies/x322at4j6pvakkps4uhg', 120, '2023-07-21', '2023-10-14', 'Thailand', NULL, '-IleYTbgk8Q', 1, 1, '2023-07-14 20:18:59', '2023-07-27 18:26:50'),
(19, 'THƯỚC PHIM KINH HOÀNG', 'movies/ekb9wpserd3hahrxam6s', 150, '2023-07-21', '2023-09-30', 'Korea, Republic of', NULL, 'pXCg0UUWEF0', 3, 1, '2023-07-14 20:21:53', '2023-07-27 18:26:44'),
