(36, 'QUÝ CÔNG TỬ', 'movies/wf7ltzcfelhdmp2k7npm', 118, '2023-06-23', '2023-08-30', 'Korea, Republic of', '<p>Quý Công Tử xoay quanh người đàn ông bí ẩn được biết đến với tên gọi “Quý Công Tử”. Gã đột nhiên xuất hiện trước mắt Marco, một thanh niên người Philippines mơ ước trở thành vận động viên boxing chuyên nghiệp, lang thang khắp các sàn đấu bất hợp pháp tại đây. Nhằm chi trả cho viện phí của mẹ, Marco đến Hàn Quốc để tìm người cha đã bỏ rơi hai mẹ con cậu từ lâu. Đụng độ Quý Công Tử cùng hàng loạt những con người bí hiểm trong thế giới ngầm, Marco trở thành mục tiêu duy nhất của những thế lực mang nhiều mục đích khác nhau. Cuộc truy đuổi điên cuồng bắt đầu.</p>', 'ybcWiZOjJj8', 3, 1, '2023-07-14 21:04:55', '2023-07-14 21:05:36'),
(37, 'TRANSFORMERS: QUÁI THÚ TRỖI DẬY', 'movies/xzjbytzha6ymw4muyyr7', 127, '2023-07-25', '2023-08-10', 'United States', '<p>Bộ phim dựa trên sự kiện Beast Wars trong loạt phim hoạt hình \"Transformers\", nơi mà các robot có khả năng biến thành động vật khổng lồ cùng chiến đấu chống lại một mối đe dọa tiềm tàng.</p>', 'lRBA1AKyUaI', 1, 0, '2023-07-14 21:18:50', '2023-08-16 03:22:56'),
(38, 'TÀ CHÚ CẤM', 'movies/doavq5dirnxefyicoeak', 122, '2023-06-23', '2023-08-30', 'Thailand', '<p>Phim kể về cặp vợ chồng Ning, Kwin và cô con gái 7 tuổi với tên gọi Ing. Vì khó khăn về tài chính, hai vợ chồng quyết định cho thuê ngôi nhà đang ở và chuyển đến một căn hộ chung cư giá rẻ để sinh sống. Sau khi những người thuê nhà chuyển đến, Ning nhận thấy chồng bắt đầu có những hành vi bất thường. Anh ta trở nên bí mật và thường biến mất khỏi căn hộ và lúc 4 giờ sáng. Kwin thậm chí còn có một hình xăm kỳ lạ ở ngực tựa như ký hiệu đặc biệt của một hội tà giáo bí ẩn. Khi hành vi của chồng ngày càng trở nên đáng lo ngại, cũng là lúc Ning nhận ra cô con gái của mình đang gặp hiểm nguy. Bí mật nào đang được che giấu trong ngôi nhà cho thuê của họ?</p>', '0oc92jGXE54', 3, 1, '2023-07-17 20:13:56', '2023-07-17 20:13:59'),
(39, 'RUBY THỦY QUÁI TUỔI TEEN', 'movies/l0g6flvltg2hc3vx7gwl', 91, '2023-07-27', '2023-08-30', 'United States', '<p>Ruby Thủy Quái Tuổi Teen kể về cô bé Ruby Gillman nhút nhát, tình cờ phát hiện ra mình là một phần của dòng dõi thủy quái hoàng gia huyền thoại. Và kể từ giây phút này, số phận của cô bé dưới đáy đại dương bỗng thay thổi hoàn toàn, cùng với đó là một sứ mệnh lớn hơn tất cả những gì cô từng mơ đến.</p>', 'egVsMzVezyg', 4, 1, '2023-07-17 20:28:53', '2023-07-27 17:48:26'),
(40, 'BLUE WHALE: THỬ THÁCH CÁ VOI XANH', 'movies/upztuuuvgkfcvvbf37vz', 100, '2023-08-04', '2023-11-01', 'Russian Federation', '<p>Sau khi em gái tự sát, Dana quyết tâm tìm kiếm nguyên nhân đằng sau cái chết đầy nghi hoặc. Cô phát hiện em mình đã tham gia một thách thức điên rồ trên mạng xã hội - #Blue_Whale – khơi màu khủng hoảng và kích động giới trẻ tự sát. Dana dần tiến sâu vào chân tướng, nhưng cô buộc phải tham gia thử thách #Blue_Whale nguy hiểm trước khi vén màn sự thật. Phim mới&nbsp;Thử thách #CáVoiXanh: Trò Chơi Kết Liễu ra mắt tại các rạp chiếu phim từ 04.08.2023&nbsp;</p>', 'nWiQodhMvz4', 3, 1, '2023-07-27 17:42:08', '2023-08-09 16:21:49'),
(41, 'TALK TO ME: GỌI HỒN QUỶ DỮ', 'movies/fqt7hmnwkjiggxfkmgwj', 93, '2023-08-19', '2023-12-09', 'Australia', '<p>Phim kinh dị đang gây chú ý tại thị trường Bắc Mỹ -<i>“Talk to me”</i> (Gọi hồn quỷ dữ) - sẽ đến với rạp Việt Nam từ ngày 11/8. Phim là tác phẩm điện ảnh đầu tay của cặp YouTuber Danny và Michael Philipou, sở hữu kênh RackaRacka với 6,67 triệu người theo dõi và hơn 1 tỷ lượt xem.</p><p><i>“</i><a href=\"https://www.vietnamplus.vn/tags/talk-to-me.vnp\"><i><strong>Talk to me</strong></i></a><i>”</i> kể về một cô gái tên Mia (Sophie Wilde) và trò chơi triệu hồi linh hồn, thông qua một bàn tay bằng sáp. Với bàn tay này, Mia đã có thể kết nối với người mẹ quá cố của cô, song vô tình giải phóng những thế lực hắc ám, đe dọa mạng sống của những người thân thiết xung quanh - những người coi cô như thành viên mới trong gia đình.</p><p><a href=\"https://www.vietnamplus.vn/oppenheimer-chinh-thuc-chieu-tu-118-nhung-se-gap-canh-tranh-lon/887070.vnp\"><strong>[\'Oppenheimer\' chính thức chiếu từ 11/8, nhưng sẽ gặp cạnh tranh lớn?]</strong></a></p><p>Ra mắt từ 28/7 tại một số quốc gia trên thế giới, <i>\"Talk to me\"</i> đang nhận về nhiều đánh giá tốt. Phim đạt 94% nhận xét tích cực từ giới phê bình, 82% từ khán giả trên Rotten Tomatoes; 76/100 điểm từ giới phê bình và 7,5/10 từ khán giả trên Metacritics.</p><p>Câu hỏi đặt ra là: Với chủ đề gọi hồn quen thuộc, <i>“Talk to me”</i> làm như thế nào để hút khách?</p><p>Đầu năm nay, phim đã ra mắt tại Liên hoan Phim Quốc tế Sundance (chuyên về phim độc lập, Mỹ) và nhận được nhiều lời khen. Phim quy tụ diễn viên mới, không nổi tiếng, đình đám, nhưng đầy tiềm năng.</p><p>Từ trang AV Club, nhà phê bình Lauren Coates nhận xét diễn xuất trong phim là yếu tố ghi điểm, đặc biệt là Sophie Wilde giúp nhân vật chính và nỗi đau mất mẹ của cô trở nên chân thực hơn.</p><figure class=\"image\"><img src=\"https://cdnimg.vietnamplus.vn/t620/uploaded/tpuohuo/2023_08_06/_methode_times_prod_web_bin_390d5a222b0411eeaede28bc53acbdb8.jpg\" alt=\"Talk to me: Phim kinh di cua cap YouTuber duoc khen ngoi tai rap hinh anh 2\"></figure><p>Nữ diễn viên trẻ Sophie Wilde tỏa sáng trong phim, với vai diễn Mia yêu cầu chiều sâu. (Ảnh: Causeway Films)</p><p>Theo nhà phê bình này,&nbsp;dù chỉ dài 1 tiếng rưỡi, <i>\"Talk to me\"</i> dành phần lớn hồi đầu tiên của phim để xây dựng mối quan hệ thân thiết xung quanh nhân vật chính, từ tình thân gia đình, tình thân với bạn bè như anh em ruột thịt.</p><p>Những yếu tố này gợi nhớ người xem đến gia đình và bạn bè của chính mình trong đời thực. Khai thác về nỗi đau, sự mất mát, bộ phim thuyết phục khán giả đồng cảm với Mia mỗi khi cô dùng bàn tay sáp để gọi hồn mẹ mình. Cây bút Lauren Coates&nbsp;cũng khen kịch bản phim mang chất hiện đại, trẻ trung.&nbsp;</p><p>Theo thông tin từ nhà phân phối tại Việt Nam (CGV), phim sẽ có nhiều phân cảnh máu me, tàn nhẫn, được thể hiện một cách trực diện và hỗn loạn đồng thời không đi theo lối mòn hù dọa gây giật mình (jumpscare) cũ kỹ.</p><p>Nhà phân phối của&nbsp;<i>\"Talk to me\"</i>&nbsp;là A24, hãng phim nổi tiếng có trụ sở tại Mỹ với gu chọn phim dị biệt, phi truyền thống, đã được khán giả yêu mến đón nhận qua những&nbsp;<i>\"</i><a href=\"https://www.vietnamplus.vn/tags/hereditary.vnp\"><i><strong>Hereditary</strong></i></a><i>\"</i>&nbsp;(Di truyền),&nbsp;<i>\"Midsommar\"</i>&nbsp;(Lễ hội ma quái) hay gần đây nhất là&nbsp;<i>\"Everything everywhere all at once\"</i>&nbsp;(Cuộc chiến đa vũ trụ) giành giải Oscar... Đây là bảo chứng cho thấy&nbsp;<i>\"Talk to me\"&nbsp;</i>cũng sẽ mang một chất kinh dị khác lạ./.</p>', 'CfWw9ubDgKI', 3, 1, '2023-08-12 09:17:38', '2023-08-12 09:17:45');
