INSERT INTO `news` (`id`, `title`, `image`, `content`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Insidious The Red Door: Ác Mộng Từ Cõi The Further', 'https://www.galaxycine.vn/media/2023/6/18/1135-2_1687028030749.jpg', 'Đã có giai đoạn, các đề tài liên quan đến cái chết, hồn ma, thế giới bên kia trở nên quá nhàm chán khi được dựng thành phim. Những màn hù dọa vô nghĩa, kịch bản lỗi thời không còn thu hút người xem. Ngay thời điểm tưởng chừng Hollywood đã cạn kiệt ý tưởng, thì cái tên James Wan xuất hiện và đem đến nỗi khiếp sợ cho nhiều người. Thành công từ Saw, Dead Silence, The Conjuring…, đã giúp vị đạo diễn gốc Á được xem như “Ông hoàng phim kinh dị” thế hệ mới. Tuy nhiên mỗi khi nhắc đến James Wan, không thể nào bỏ qua Insidious – thương hiệu sở hữu bộ sưu tập “ma quỷ” lừng lẫy góp phần hồi sinh thể loại suýt bị bỏ quên.', 1, 1, '2023-06-29 13:16:17', NULL),
(2, 'Transformers: Rise Of The Beasts Có Những Nhân Vật Nào? (P2)', 'https://www.galaxycine.vn/media/2023/6/4/1135_1685813722976.jpg', 'Tính từ lúc ra đời, thương hiệu Transformers chỉ cần 2 năm nữa là sẽ tròn 40 tuổi. Có thể xem đây như một trong những nhãn hàng đồ chơi lâu đời và phổ biến nhất mọi thời đại. Thử nghĩ em, những chiếc xe ô tô và xe tải có thể biến hình thành các chiến binh robot thì tuyệt vời biết bao. Tất nhiên cũng không khó hiểu khi Transformers được chuyển thể thành phim hoạt hình để phục vụ sự hâm mộ của trẻ em. Khi mà những ký ức đẹp trở thành hoài niệm thì cũng là lúc các nhà làm phim hướng đến việc thực hiện phiên bản live-action. Cuối cùng, nhờ bàn tay của Ông hoàng cháy nổ Michael Bay, thì bom tấn Transformers cũng chính thức ra mắt tại các rạp chiếu phim vào năm 2007.\n         Sau lần công phá phòng vé ấy, đã có tổng cộng 5 phần phim tiếp theo được công chiếu. Hàng loạt ý kiến trái chiều từ phía khán giả và các nhà phê bình tràn ngập khắp nơi. Tuy nhiên sự công kích đã giảm dần khi Bumblebee (2018) xuất hiện. Tác phẩm được xem như phần tiền truyện, đồng thời có vai trò báo hiệu cho việc hồi sinh series Transformers. Có thể Bumblebee không đạt doanh thu như kỳ vọng, nhưng điều khả quan ở đây là chất lượng phim được nhận định là tốt nhất từ trước đến nay. Thế nên, việc bám theo những sự kiện diễn ra sau phần Bumblebee sẽ là nước đi khôn khoan. Từ đấy, Transformers: Rise Of The Beasts hứa hẹn không chỉ đem tới màn tái xuất của Optimus Prime, mà còn có nội dung bám sát theo cốt truyện Beast Wars (1996). Có thể timeline của phim lúc này có phần hơi rối rắm, nhưng với dàn nhân vật chính diện lẫn phản diện vốn đã quá cuốn hút thì phần phim mới vẫn sẽ tạo được sự phấn khích với đám đông.', 1, 1, '2023-06-29 13:16:17', NULL),
(3, '[Review] The Flash: Ezra Miller Diễn Xuất Sắc Làm Lu Mờ Loạt Scandal Chấn Động!', 'https://www.galaxycine.vn/media/2023/6/16/the-flash-ezra-miller-dien-xuat-sac-lam-lu-mo-loat-scandal-chan-dong-4_1686932681045.jpg', 'Trong The Flash, Ezra Miller thành công hóa thân thành hai Barry Allen rất khác biệt. Barry lớn mất mẹ xa cha, thiếu thốn tình cảm, sống khép kín và đầy tài năng. Barry nhỏ lớn lên giữa tình yêu thương, đang ở giai đoạn nổi loạn tuổi mới lớn, bạn bè vây quanh. Khán giả khó lòng cảm thấy một người đang đảm nhận hai vai. Điều đó không phải diễn viên trẻ nào cũng làm nổi, nhất là khi Barry lớn - nhỏ đi chung quá nhiều. Người bình thường và chẳng hề có năng lực đặc biệt ngoài tiền đầy kho, Batman luôn là nhân vật  cộng đồng fan DC yêu thích nhất nhì. Lần này, “Batman” Ben Affleck chỉ lên hình ít ỏi nhưng gây ấn tượng mạnh mẽ nhờ phong thái chững chạc. Mặt khác, đất diễn quan trọng trong phim được trao về ngài Batman từng làm nức lòng khán giả cuối thế kỉ 20 – Michael Keaton. Điềm tĩnh, phong độ, oai vệ… “Batman” Keaton mang đến cảm giác khác biệt rõ rệt so với Christian Bale, Ben Affleck hay Robert Pattinson. Cao 1m7, gương mặt cá tính, thân hình tuyệt đẹp… Xuất hiện không nhiều, Sasha Calle hút hồn bởi hình ảnh Supergirl cá tính, cứng rắn nhưng tốt bụng. Hy vọng rằng dù DC Comic và Warner Bros thay máu toàn bộ, Calle vẫn nằm trong danh sách chọn lựa thể hiện Supergirl. Andy Muschietti đâu phải cái tên xa lạ gì với mọt phim. Mama (2013), It (2017), It: Chapter Two (2019) đều là tác phẩm thành công và nhận đánh giá khá tốt từ giới chuyên môn. Lần đầu bước qua mảng siêu anh hùng,\n         vị đạo diễn sinh năm 1973 chẳng hề bỡ ngỡ. Nhịp phim nhanh gọn, đôi chỗ dài dòng nhưng mang mục đích đào sâu hơn về nội tâm nhân vật, tình tiết hài xen kẽ hợp lý. Những màn xáp lá cà, đua tốc độ dàn trải suốt phim, khiến người xem khó thể rời mắt khỏi màn hình. Đặc biệt, tài năng của Muschietti kết hợp cùng diễn xuất tuyệt vời của Miller làm nên khung hình Flash vs Flash vô cùng sinh động, khó phim siêu anh hùng nào sánh được. Ngoài phân đoạn tri ân loạt tên tuổi lừng danh đã từng gắn bó với các chuyển thể siêu anh hùng DC lên màn ảnh rộng cũng khiến công chúng vô cùng xúc động, phim còn có một cameo bất ngờ.   Sự xuất sắc của The Flash là dấu chấm hết đẹp cho 10 năm DCEU, hãy cùng chờ xem tân chủ tịch James Gunn  sẽ khởi động lại vũ trụ điện ảnh hoành tráng này như thế nào!', 1, 1, '2023-06-29 13:16:17', NULL),
(4, '[Review] Spider-Man Across The Spider-Verse: Phim Siêu Anh Hùng Xuất Sắc Nhất Từ Trước Đến Nay?', 'https://www.galaxycine.vn/media/2023/6/8/spider-man-across-the-spider-verse-phim-sieu-anh-hung-xuat-sac-nhat-tu-truoc-den-nay-3_1686212459824.jpg', '5 năm trước, cả thế giới chao đảo vì Spider-Man: Into The Spider-Verse phá vỡ mọi giới hạn phim siêu anh hùng. Cậu nhóc Miles Morales đang sống cuộc đời bình thường với vài rắc rối của tuổi dậy thì. Thế nhưng, mọi thứ đổi hoàn toàn khi cậu bị nhện đột biến cắn. Được Người Nhện Peter Parker hi sinh cứu sống, Miles phải thay anh đối đầu gã Kingpin điên cuồng. Khao khát làm vợ con “sống lại”, tên phản diện này quyết tâm xé toạc vũ trụ để “bắt cóc” họ từ dòng thời gian khác… Năm 2023, cùng trở lại thành phố New York - nơi cậu nhóc Miles Morales mười lăm tuổi đang ngày càng thành thạo kĩ năng siêu anh hùng. Tuy nhiên, tương tự những Người Nhện khác, càng nhiều người được cứu, cậu càng tạo ra vô số kẻ thù. Liệu cậu có thể thay đổi số mệnh của mình? Dù thay đổi ít nhiều ghế đạo diễn và biên kịch, Across The Spider-Verse vẫn thống nhất về cốt truyện Into The Spider-Verse. Tâm lý nhân vật chính - Miles và Gwen đến vai phụ - Peter Parker hay bố mẹ Miles đều được xây dựng hợp lí và liền mạch với phần trước. Độ dài 140 phút cũng đủ giúp Across The Spider-Verse tô da đắp thịt cho những cái tên mới xuất hiện - Hobie Brown hay Miguel O’Hara. “Làm Spider-Man là một sự hi sinh.”, “Sức mạnh càng lớn, trách nhiệm càng nhiều.”… Số mệnh định sẵn muốn trở thành Người Nhện là PHẢI mất mát. Thế nhưng, cậu nhóc Miles Morales còn quá nhỏ để thấu hiểu Miguel O\'Hara.', 1, 1, '2023-06-29 13:16:17', NULL),
(5, 'Doraemon Hóa Phi Công Trong Phim Điện Ảnh Mới Nhất', 'https://www.galaxycine.vn/media/2023/5/17/doraemon-movie-2023-1_1684306892503.jpg', '<h2><strong>\'Doraemon: Nobita và vùng đất lý tưởng trên bầu trời\' - phần phim điện ảnh mới nhất năm 2023 từng kéo hơn 3,3 triệu khán giả Nhật đến rạp sẽ công chiếu tại Việt Nam từ 26/5/2023.</strong></h2><p>Phần phim mới nhất xoay quanh chuyến phiêu lưu của Doraemon, Nobita và những người bạn thân tới Paradapia - hòn đảo hình trăng lưỡi liềm lơ lửng trên bầu trời. Ở đó, tất cả đều hoàn hảo đến mức cậu nhóc Nobita mê ngủ ngày cũng có thể trở thành một thần đồng toán học, một siêu sao thể thao.</p><p>Cả hội cùng sử dụng một món bảo bối độc đáo chưa từng xuất hiện để đến với xứ sở tuyệt vời này. Cùng với những người bạn ở đây, đặc biệt là chàng robot mèo Sonya, Doraemon và các chiến hữu đã có chuyến hành trình tới vương quốc trên mây cho đến khi nhiều bí mật đằng sau vùng đất lý tưởng được hé lộ…</p><figure class=\"image\"><img src=\"https://static-images.vnncdn.net/files/publish/2023/5/5/13-2bbbbbbb-844.jpg\"></figure><p><a href=\"https://vietnamnet.vn/doraemon-tag13100795571950037803.html\"><i>Doraemon</i></a><i>: Nobita và vùng đất lý tưởng trên bầu trời </i>ra mắt tại Nhật Bản hồi tháng 3 vừa qua và nhận được phản ứng vô cùng tích cực. Phim đạt số điểm 3.9/5.0 trên trang đánh giá Eiga.com và 4.1/5.0 trên trang đánh giá Yahoo Movies, lọt top những phần có điểm số cao nhất.&nbsp;</p><p>Ở tuần thứ 7 sau khi khởi chiếu, <i>Doraemon: Nobita và vùng đất lý tưởng trên bầu trời (Doraemon The Movie: Nobita’s Sky Utopia 2023) </i>đã hút 3,37 triệu lượt khán giả đến rạp tại Nhật Bản, vượt mốc doanh thu 4 tỷ Yên.&nbsp;&nbsp;</p><figure class=\"image\"><img src=\"https://static-images.vnncdn.net/files/publish/2023/5/5/21aaaaaa-845.jpg\"><figcaption>&nbsp;</figcaption></figure><p>Khán giả Nhật Bản đánh giá, phần phim thứ 42 của loạt Doraemon có cốt truyện đặc sắc nhất, chạm đến trái tim của không chỉ các bạn nhỏ mà cả người lớn. Cùng với kịch bản được đánh giá cao, phần hình ảnh&nbsp;nhận được rất nhiều lời khen.</p><p>Nét vẽ của <a href=\"https://vietnamnet.vn/giai-tri/phim\">phim</a> trau chuốt, phần chuyển động hoạt hình mượt mà, những góc máy quay mới mẻ đặc tả cảm xúc nhân vật giúp trải nghiệm điện ảnh tại rạp thêm trọn vẹn. Tạo hình siêu đáng yêu của nhóm bạn với bộ đồ phi công, cũng như những biểu cảm dễ thương của Doraemon hứa hẹn gây cơn sốt lớn.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://static-images.vnncdn.net/files/publish/2023/5/5/8-1aaaaa-846.jpg\"><figcaption>&nbsp;</figcaption></figure><p>Bên cạnh đó, sự tham gia của “quốc bảo ikemen” - nam ca sĩ, diễn viên rất được yêu mến Nagase Ren trong vai trò lồng tiếng cho nhân vật mèo máy Sonya cũng là một điểm khiến người xem cực kỳ phấn khích.&nbsp;</p>', 1, 1, '2023-06-29 13:16:17', '2023-07-14 00:07:25'),
(7, 'HỘP BẮP SINH NHẬT CGV', 'news/tzpginsh4vidtpif4qor', '<p><strong>1. CGV mang đến món quà đặc biệt dành cho các bạn thành viên:</strong></p><p>- Khi trở thành thành viên theo chính sách của CGV, bạn sẽ nhận được các quyền lợi vào tháng sinh nhật*, trong đó có phần quà là 01&nbsp;CGV Birthday Combo (gồm bắp và nước).</p><p>- Riêng phần bắp quà tặng này, CGV sẽ thay đổi sử dụng hộp bắp sinh nhật với bao bì được thiết kế riêng và đặc biệt.</p><p><strong>2. Thời gian áp dụng:</strong></p><p>- Khu vực TPHCM: Từ ngày 20/08/2022.</p><p>- Khu vực khác: Từ ngày 25/08/2022.</p><p>CGV mong rằng đây tuy là một sự thay đổi nhỏ nhưng mang đến nhiều ý nghĩa cho các bạn thành viên, những người đã luôn yêu quý và sử dụng dịch vụ của CGV.</p><p><strong>3. Lưu ý:</strong></p><p>- Số lượng hộp bắp sinh nhật có hạn, tùy vào số lượng tại từng rạp.</p><p>- Khi hết hộp bắp sinh nhật, CGV sẽ quay lại phục vụ bằng túi bắp thường.</p><p>*Chính sách thành viên và quà tặng sinh nhật xem <a href=\"https://www.cgv.vn/default/cgv-membership\">tại đây</a>.&nbsp;</p><p>&nbsp;</p><p><strong>ĐẶT VÉ NGAY &gt;&gt;</strong><br><br><strong>-&nbsp;</strong><a href=\"https://www.cgv.vn/default/movies/now-showing.html\"><strong>ĐẶT VÉ THEO PHIM</strong></a></p><p><strong>-&nbsp;</strong><a href=\"https://www.cgv.vn/default/cinox/site/\"><strong>ĐẶT VÉ THEO RẠP</strong></a></p><p>&nbsp;</p><p><strong>Tải app CGV để đặt vé chọn chỗ sớm hơn, nhanh hơn:</strong></p><p>-&nbsp;<a href=\"https://apps.apple.com/us/app/cgv-cinemas/id1067166194\">Tải CGV Cinemas cho iOS</a></p><p>-&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.cgv.cinema.vn\">Tải CGV Cinemas cho Android</a></p>', 0, 1, '2023-07-14 17:03:27', '2023-07-18 08:20:15');
